INSERT INTO `integrante` (`idintegrante`, `idclube`, `funcao`, `nome_integrante`, `resumo`, `url_img`) VALUES
(1, 1, 'Presidente', 'Pereira, Carlos', 'José Carlos Rodrigues Pereira is the president of Portuguese association football club C.S. Marítimo. A businessman by profession, Pereira took over the reins of C.S. Marítimo on 4 July 1997, when he was elected to replace the previous chairman Rui Fontes.', NULL),
(2, 1, 'Treinador', 'Pedro Rui Mota Vieira Martins', 'Pedro Rui da Mota Vieira Martins (born 17 July 1970 in Santa Maria da Feira) is a retired Portuguese footballer, who played as a defensive midfielder.', NULL),
(3, 2, 'Presidente', 'Campos, Antonio', 'António Pereira Campos é um dos primeiros cineastas em Portugal a dedicar-se à prática do filme documentário na perspectiva da antropologia visual. Praticando mais o documentário puro, ensaia a docuficção. Na ficção, explora o filme etnográfico recorrendo às técnicas do cinema directo. No documentário, é um dos elementos fundadores do movimento do Novo Cinema em Portugal. Inicia-se na prática do filme etnográfico no início dos anos sessenta, ao mesmo tempo que o cineasta norte-americano John Marshall, que filma os bochimanes da Namíbia em 1957 : The Hunters, o seu primeiro filme. Ao mesmo tempo, revela-se o canadiano Michel Brault, uns dos pioneiros do cinema directo. António Campos segue, pouco sabendo dele, os passos de Jean Rouch, em particular no que hoje se chama etnografia de salvaguarda.', NULL),
(4, 2, 'Treinador', 'Carlos Luís Cereja Morais Brito', 'Carlos Luís Cereja de Morais Brito (born 21 September 1963 in Porto) is a retired Portuguese footballer who played as a central defender, and the current manager of Rio Ave Futebol Clube. Most of his career was associated with Rio Ave, which he represented as both a player and manager, the latter in various spells.', NULL),
(5, 3, 'Jogador', 'Pablo César Aimar Giordano', 'Pablo César Aimar Giordano,, é um futebolista argentino que também possui passaporte espanhol. Atualmente, joga no Predefinição:PtBF Pablo Aimar é dono de uma técnica apuradíssima aliada a uma grande velocidade, permitindo-lhe ser um meia organizador de jogo e desequilibrador em simultâneo. Aimar possui ainda uma grande visão de jogo, o que lhe faz criar linhas de passe para fazer assistências aos companheiros de equipe.', NULL),
(6, 3, 'Jogador', 'Nemanja Matić', 'Nemanja Matić - em sérvio, Немања Матић - é um futebolista sérvio que joga como Meia. Atualmente, joga pelo', NULL),
(7, 3, 'Jogador', 'Nuno Miguel Prata Coelho', 'Não confundir com Nuno André Coelho. Predefinição:Info/Futebolista Nuno Miguel Prata Coelho mais conhecido por Nuno Coelho e é um futebolista Português, que joga no Predefinição:PtBF', NULL),
(8, 3, 'Jogador', 'Ezequiel Marcelo Garay', 'Ezequiel Marcelo Garay é um futebolista argentino. Atualmente, joga pelo Real Madrid.', NULL),
(9, 3, 'Jogador', 'Ruben Filipe Marques Amorim', 'Rúben Filipe Marques Amorim é um futebolista português, que joga actualmente no Sport Lisboa e Benfica. Começou a sua formação no Benfica tendo sido dispensado, o Sporting Clube de Portugal contratou-o onde uma vez mais acabou por ser dispensado, teve ainda uma passagem pelo C.A.C. da Pontinha e Ginásio de Corroios de onde depois se transferiu para o Belenenses. Após 5 anos em evidência no Belenenses onde jogava habitualmente como médio centro, Rúben Amorim assinou um contrato de quatro anos pelo Benfica, tendo sido apresentado oficialmente a 7 de Julho de 2008. Conta com uma internacionalização por Portugal na selecção \\"B\\" e dez pelos sub-21. Foi chamado para o Campeonato do Mundo FIFA de 2010 para substituir o lesionado Nani.', NULL),
(10, 3, 'Jogador', 'Franco Daniel Jara', 'Franco Daniel Jara é um jogador de futebol argentino que joga actualmente pelo clube Português Sport Lisboa e Benfica como ponta-de-lança.', NULL),
(11, 3, 'Jogador', 'Bruno César Zanaki', 'Bruno César Zanaki é um futebolista brasileiro que atua como meia. Atualmente, joga no Predefinição:PtBF. Muito criativo e técnico, suas principais características são os passes rápidos e precisos, além dos chutes perigosos de média/longa distância.', NULL),
(12, 3, 'Jogador', 'Carlos Jorge Neto Martins', 'Carlos Jorge Neto Martins é um médio centro internacional português. Actualmente, joga pelo Predefinição:PtBF. Dono de um potente remate e muita garra em campo, ganhou o apelido de Rambo dos torcedores do Benfica. Antigo jogador do Predefinição:PtSP, actualmente o médio actua nos rivais, transferindo-se para a Luz vindo dos espanhois do Recreativo Huelva a troco de 3 milhões de euros.', 'true'),
(13, 3, 'Jogador', 'Roberto Jiménez Gago', 'Roberto Jiménez Gago, ou simplesmente Roberto, é um guarda-redes espanhol que actualmente joga no clube do Sport Lisboa e Benfica da 1. ª Liga Portuguesa. Roberto custou aos cofres da luz 8,5 milhões de euros.', NULL),
(14, 3, 'Jogador', 'Fredua Koranteng Adu', 'Fredua Koranteg Adu, mais conhecido como Freddy Adu, é um futebolista nascido no Gana e naturalizado americano que actua como avançado. Tem vínculo com o Benfica, porém está emprestado ao clube turco Çaykur Rizespor.', 'true'),
(15, 3, 'Jogador', 'Javier Ángel Balboa Osa', 'Javier Ángel Balboa Osa, conhecido simplesmente como Balboa ou Javier Ángel -em sua passagem no Cartagena da Espanha-, é um futebolista naturalizado guinéu-equatoriano. Tem 1,82 m, pesa 74 kg e joga habitualmente como meio-campista (extremo-direito ou esquerdo). É jogador do Sport Lisboa e Benfica desde Junho de 2008.', NULL),
(16, 3, 'Jogador', 'Francisco Javier García Fernández', 'Francisco Javier \\''Javi\\'' García Fernández, mais conhecido como Javi García, é um futebolista espanhol que actua como médio-defensivo. Actualmente, joga pelo Benfica. É primo do futebolista de Luis García.', NULL),
(17, 3, 'Jogador', 'Paulo César Silva Peixoto', 'Paulo César Silva Peixoto, mais conhecido por César Peixoto, é um futebolista português. Namora com a modelo, actriz e apresentadora de televisão Diana Chaves. É um extremo esquerdo catapultado para a ribalta após a transferência do clube da sua terra Caçadores Taipas para o CF Belenenses onde apontou diversos golos e que lhe valeu a transferência para o F.C. Porto na época seguinte.', NULL),
(18, 3, 'Jogador', 'Joan Capdevila i Méndez', 'Joan Capdevila i Méndez é um futebolista espanhol que atua como lateral-esquerdo. Atualmente, joga pelo Villarreal.', NULL),
(19, 3, 'Jogador', 'Javier Pedro Saviola Fernández', 'Javier Pedro Saviola Fernández é um futebolista argentino que atua como atacante. Atualmente, joga pelo Benfica.', 'true'),
(20, 3, 'Jogador', 'Axel Thomas Witsel', 'Axel Thomas Witsel é um futebolista belga que atua como volante. Atualmente, joga pelo Standard Liège. Ele causou a grave lesão do jogador Marcin Wasilewski que no lance fraturou a perna.', 'true'),
(21, 3, 'Jogador', 'Óscar René Cardozo', 'Óscar René Cardozo Marin é um futebolista paraguaio que joga actualmente no Sport Lisboa e Benfica da Liga Portuguesa. As suas principais características são o potente pé esquerdo, o jogo aéreo e a marcação de livres directos o que faz deste jogador, aos 27 anos, um dos maiores avançados da Selecção do Paraguai. Letal com o pé esquerdo, é um ponta-de-lança que tem mostrado uma evolução natural após o seu período de adaptação natural ao futebol Europeu, sendo já um dos ídolos da plateia benfiquista. Tornou-se na 2. ª mais cara contratação de sempre do Sport Lisboa e Benfica quando, no Verão de 2007, o clube lisboeta pagou 9,15 milhões de euros por 80% do seu passe, tendo recentemente adquirido a restante percentagem a troco de mais 2,5 milhões de euros. Estes números apenas são ultrapassados pelos 13 milhões que trouxeram, em 2001, Simão Sabrosa para a Luz.', NULL),
(22, 3, 'Jogador', 'Osvaldo Nicolás Fabián Gaitán', 'Osvaldo Nicolás Fabián Gaitán, é um futebolista argentino que joga na posição de médio-ofensivo, extremo ou segundo avançado, e que atualmente defende o Sport Lisboa e Benfica.', NULL),
(23, 3, 'Jogador', 'Júlio César Jacobi', 'Júlio César Jacobi é um futebolista brasileiro que atua como goleiro. Atualmente, joga no Predefinição:PtBF. Revelado pelo Paraná Clube, foi transferido ainda nas categorias de base para o Botafogo. O jovem goleiro, vem se destacando pela sua facilidade de pegar cobranças de pênaltis, tendo a mesma facilidade que tinha o seu ídolo como goleiro, Taffarel.', NULL),
(24, 3, 'Jogador', 'Enzo Nicolás Pérez', 'Enzo Nicolás Pérez é um futebolista argentino que atualmente joga pelo Barcelona}.', 'true'),
(25, 3, 'Jogador', 'Victorio Maximiliano Pereira Páez', 'Victorio Maximiliano Pereira Páez é um futebolista uruguaio que pode actuar como lateral ou como médio, sempre pelo lado direito. Actualmente joga pelo Benfica, onde chegou no Verão de 2007 a troco de 3 milhões de euros por 70% dos direitos económicos do atleta. Fez sua estreia oficial pelo Predefinição:PtBF a 2 de Setembro de 2007, num jogo no Estádio da Madeira frente ao Nacional onde actuou durante toda a partida. Um dos seus momentos altos nessa época foi quando marcou um grande golo no Estádio da Luz frente ao AC Milan, em jogo a contar para a Liga dos Campeões (o jogo terminaria empatado 1-1) Com a saída de Nélson para o Bétis de Sevilha, Maxi foi o escolhido para ocupar a posição de lateral direito. Agarrou a oportunidade e tornou-se um dos pilares da defesa do clube e um dos jogadores favoritos dos adeptos. É um dos habituais da actual selecção uruguaia. Integrou o elenco que disputou a Copa do Mundo FIFA de 2010 tendo marcado um belíssimo golo na semifinal contra a Holanda nessa Copa.', NULL),
(26, 3, 'Jogador', 'Emerson da Conceição', 'Emerson da Conceição born February 23, 1986 in São Paulo) better known as Emerson, is a Brazilian footballer currently playing for Benfica. His primary position is as a defender.', NULL),
(27, 3, 'Jogador', 'Rodrigo Moreno Machado', 'Rodrigo Moreno Machado, mais conhecido como Rodrigo Moreno, é um futebolista naturalizado espanhol que actua como médio ofensivo. Actualmente joga pelo Bolton Wanderers emprestado pelo Predefinição:Futebol Benfica. Rodrigo é brasileiro, mas naturalizou-se espanhol tendo jogado pela Seleção Espanhola Sub-19.', NULL),
(28, 3, 'Jogador', 'Nélson Miguel Castro Oliveira', 'Nélson Miguel Castro Oliveira, é um futebolista português que joga como ponta-de-lança. Actualmente, joga pelo Paços de Ferreira, por empréstimo do Benfica. Formado pelas escolas de futebol do Santa Maria FC, com apenas Predefinição:Idade anos, é uma das maiores esperanças do futebol português.', NULL),
(29, 3, 'Jogador', 'Miguel Ângelo Leonardo Vítor', 'Miguel Ângelo Leonardo Vítor, é um futebolista português que joga habitualmente a defesa centro. Iniciou-se como júnior no Benfica, e teve a sua primeira convocatória e estreia a titular na época 2007/2008, mais propriamente a 25/08/2007 contra o Vitória de Guimarães, para colmatar as lesões dos restantes defesas habitualmente titulares na equipa. Nesse jogo a equipa não sofreu golos e o jogador foi muito aplaudido pelos adeptos benfiquistas. Depois de um empréstimo ao Clube Desportivo das Aves este voltou a integrar o plantel das "águias". É o mais recente valor das camadas jovens do Benfica, prometendo uma longa carreira no clube.', 'true'),
(30, 3, 'Jogador', 'André Gomes Magalhães Almeida', 'André Gomes Magalhães de Almeida (born 10 September 1990 in Lisbon) is a Portuguese footballer who plays for S.L. Benfica as a right-back', NULL),
(31, 3, 'Jogador', 'Michael Simões Domingues', 'Michael Simões Domingues, aka Mika, is a Portuguese footballer who plays for S.L. Benfica as a goalkeeper.', NULL),
(32, 3, 'Jogador', 'Fábio do Passo Faria', 'Fábio do Passo Faria é um futebolista português, joga como defesa central e defesa-esquerdo, e representa actualmente o Benfica.', NULL),
(33, 3, 'Jogador', 'Manuel Agudo Durán', 'Manuel Agudo Durán é um futebolista espanhol que joga actualmente no S.L. Benfica.', NULL),
(34, 3, 'Jogador', 'Rúben Rafael Melo Silva Pinto', 'Rúben Rafael Melo Silva Pinto (born 24 April 1992 in Odivelas) is a Portuguese footballer who plays for S.L. Benfica as an attacking midfielder.', NULL),
(35, 3, 'Jogador', 'Lionel Carole', 'Lionel Carole (born 12 April 1991 in Montreuil) is a French football player of Martiniquais descent who plays for Portuguese club Benfica in the Primeira Liga. He plays as a left back and is a French youth international having earned caps at under-17, under-20, and under-21 level.', NULL),
(36, 3, 'Presidente', 'Vieira, Luis Filipe', 'Luís Filipe Vieira, é o presidente do Sport Lisboa e Benfica. Foi eleito em 3 de Novembro de 2003 como 34º presidente do Sport Lisboa e Benfica. Durante os seus mandatos a equipa principal de futebol do clube conquistou vários troféus, entre os quais se destacam os Campeonatos de 2004/2005 e 2009/2010 a Taça de Portugal de 2003/2004 e as Taças de Liga de 2008/2009 e 2009/2010 e 2010/2011 Foi reeleito para um segundo mandato a 27 de Outubro de 2006. Três anos depois, em 3 de Julho de 2009, foi reeleito para um terceiro mandato, mantendo-se em funções até à data, tendo vencido o seu adversário Bruno Carvalho com 91,74% dos votos, depois de ter demitido a direcção para provocar eleições antecipadas.', 'true'),
(37, 3, 'Treinador', 'Jorge Fernando Pinheiro Jesus', 'Jorge Fernando Pinheiro de Jesus mais conhecido como Jorge Jesus é treinador de futebol português que actualmente treina o Sport Lisboa e Benfica.', NULL),
(38, 5, 'Jogador', 'Tiago Alexandre Baptista Ferreira', 'O português Tiago Alexandre Baptista Ferreira, ou apenas Tiago, é um jogador profissional de futebol. Tiago, que nasceu a 16 de Abril de 1975 em A-dos-Cunhados, Torres Vedras é um guarda-redes português. Joga no Sporting desde 1995/96, e esteve emprestado por duas épocas (1999-2001) ao Estrela da Amadora. Iniciou a carreira profissional no Sporting Clube Lourinhanense em 1993/94. Teve propostas para a internacionalização, nomeadamente para clubes do médio oriente, optando no entanto por continuar no Sporting. É neste momento o jogador mais antigo do plantel leonino, merecendo a confiança de todos os que acreditam no Clube de Alvalade. Tiago é conhecido pelo seu amor à camisola e em recentes declarações disse pretender terminar a sua carreira no Sporting Clube de Portugal. Tiago partilhou já balneário com personalidades como Cristiano Ronaldo, João Pinto, Pedro Barbosa, Jardel, Beto ou Paulo Bento, entre muitos outros que se formaram ou já passaram pelo clube leonino. Renovou em 2008 com o Sporting por mais 1 temporada. É um dos líderes do balneário sportinguista, pois vai fazer a 15ª época pelos leões.', NULL),
(39, 5, 'Jogador', 'Diego Capel Trinidad', 'Diego Capel Trinidad é um futebolista espanhol que atua como meia. Atualmente, joga pelo Sevilla.', NULL),
(40, 5, 'Jogador', 'Matías Ariel Fernández Fernández', 'Matías Ariel Fernández ou simplesmente Matías Fernández, é um futebolista nascido na Argentina, de nacionalidade chilena. Em 2006 foi eleito o Melhor Jogador da América, em uma pesquisa realizadas com diversos jornalistas do continente. Atualmente, defende o Predefinição:PtSP.', NULL),
(41, 5, 'Jogador', 'Leandro Damián Marcelo Grimi', 'Leandro Grimi é um futebolista argentino.', NULL),
(42, 5, 'Jogador', 'Nuno Ricardo Santos Belchior', 'Nuno Ricardo Santos Belchior better known as Belchior (born 9 October 1982) is a Portuguese beach soccer player. He plays in forward position.', NULL),
(43, 5, 'Jogador', 'Luis Bernando Aguiar Burgos', 'Luís Bernardo Aguiar Burgos é um futebolista uruguaio que joga como médio avançado. Atualmente joga pelo Sporting CP. Iniciou a sua carreira profissional no Liverpool Fútbol Club mas foi emprestado ao FC Porto com opção de compra no final da época de 2007/2008. O FC Porto por sua vez emprestou o jogador ao Estrela da Amadora até ao final da época (2007-2008), para ocupar o lugar de Binya (este jogador africano foi para o SL Benfica). Porém no início de 2008 foi emprestado à Académica. Em Junho de 2008 assinou um contrato válido por 4 épocas pelo Sporting Clube de Braga, terminando desta forma o seu vinculo contratual com o Futebol Clube do Porto. Após várias boas exibições ao serviço do Braga na Taça Uefa despertou a atenção de clubes europeus, tendo no final da época 2008/2009 assinado pelo Dínamo de Moscovo. Após meia época no clube russo, o Sporting Clube de Braga chegou a acordo com o Dínamo de Moscovo para a cedência a título de empréstimo dos direitos desportivos do médio, que rubricou com os "Guerreiros do Minho" um contrato válido até final da época 2009/10. Predefinição:Referências', 'true'),
(44, 5, 'Jogador', 'André Filipe Bernardes Santos', 'André Filipe Bernardes Santos (born 20 March 1989 in Sobreiro Curvo, Torres Vedras) is a Portuguese footballer who plays for Sporting Clube de Portugal as a defensive midfielder.', NULL),
(45, 5, 'Jogador', 'Marat Nailevich Izmailov', 'Marat Nailevich Izmaylov - em russo, Марат Наилевич Измайловe - é um futebolista russo que atua como meia. Atualmente, joga pelo Sporting.', NULL),
(46, 5, 'Jogador', 'Hélder Manuel Marques Postiga', 'Hélder Manuel Marques Postiga é um futebolista português que começou a sua carreira no Varzim Sport Club. Mais tarde entrando para o juvenis do FC Porto e por sua vez na equipa B, no qual o treinador Fernando Santos o convocava ocasionalmente para a equipa principal. Actualmente, é o artilheiro do Real Sport Club, com um total de 2 golos em 50 jogos.', 'true'),
(47, 5, 'Jogador', 'Tales Tlaija de Souza', 'Tales Tlaija de Souza, conhecido como Tales é um futebolista brasileiro. Foi promovido em 2009 das categorias de base do SC Internacional, onde atuou como volante. Foi peça fundamental para a conquista da Campeonato Sul-americano de Futebol Sub-20. Teve 76 participações entre todas as seleções de base do Brasil. É o único jogador de sua geração que foi convocado para todas as categorias de base da seleção brasileira. Actualmente Tales é jogador do Sporting Clube de Portugal.', NULL),
(48, 5, 'Jogador', 'Rui Pedro dos Santos Patrício', 'Rui Pedro dos Santos Patrício é um jogador profissional de futebol. Patrício é actualmente guarda-redes do Sporting Clube de Portugal e é apontado como uma grande promessa do futebol português. Os responsáveis do Sporting Clube de Portugal vêem nele o futuro dono da baliza do clube devido à já grande segurança e qualidade que evidencia apesar de ainda muito jovem. Tem sido convocado a Selecção Portuguesa de Futebol mas ainda só tem duas presenças.', NULL),
(49, 5, 'Jogador', 'Marco António Simões Caneira', 'Marco António Simões Caneira nasceu a 9 de Fevereiro de 1979, em Sintra, e é um polivalente defesa do plantel de futebol profissional do Sporting Clube de Portugal, começou a carreira nas camadas jovens do Sporting mas saiu do clube juntamente com Alhandra e Paulo Costa, quando era júnior no meio de uma história algo conturbada. Após representar o Sporting Clube de Portugal, o Lourinhanense (por empréstimo), o Salgueiros (por empréstimo), alguns clubes em França e Itália, como o Bordeaux, esteve uma época no Benfica. Depois foi emprestado ao Valencia CF de Espanha na época 2004-2005 e que o comprou na época seguinte. Na 2ª metade da época foi emprestado ao Sporting Clube de Portugal, voltando a ser emprestado ao mesmo clube na época 2006-2007. No início da época 2007-2008, Caneira foi chamado de volta ao plantel principal do Valencia. Em Junho de 2008, assinou por 4 épocas (até 2012) pelo Sporting Clube de Portugal a custo zero.', NULL),
(50, 5, 'Jogador', 'João Pedro Espírito Santo Gonçalves', 'João Pedro do Espírito Santo Gonçalves (born 18 January 1988 in Amadora) is a Portuguese footballer who plays for Sporting Clube de Portugal as a right defender.', NULL),
(51, 5, 'Jogador', 'João Victor Saraiva', 'João Víctor Saraiva, conhecido como Madjer, é um jogador da selecção portuguesa de futebol de praia. Quando era jovem gostava bastante de futebol e chegou a representar o Estoril-Praia nas camadas jovens. Devido à sua artística forma de jogar adquiriu a alcunha de Madjer, em homenagem ao famoso jogador do F. C. Porto, Rabah Madjer. A certa altura lesionou-se com alguma gravidade e ausentou-se dos relvados durante algum tempo. No entanto, quando já estava recuperado, partipou num torneio amador de futebol de praia e o treinador da selecção portuguesa, João Barnabé, admirando a sua forma de jogar, convidou-o para entrar na selecção. Desde então, começou logo a deslumbrar com a sua arte na areia: golos, remates fortíssimos e muitas acrobacias, destacando-se os pontapés de bicicleta. Na selecção, Madjer fez vários amigos, como a brasileiro Alan, naturalizado português, e levou Portugal à vitória em muitas competições, com destaque para a medalha de ouro na Copa do Mundo de Futebol de Praia de 2001, na Costa do Sauípe, no Brasil. Madjer conquistou também muitos prémios de melhor jogador e melhor marcador de vários torneios, devendo realçar-se o prémio de melhor jogador e melhor marcador, com 21 golos, na Copa do Mundo FIFA de Futebol de Areia de 2006, uma competição que foi organizada pela FIFA.', NULL),
(52, 5, 'Jogador', 'André Martín Carrillo Díaz', 'André Carrillo Diaz é um futebolista do Peru. Joga como médio ou segundo avançado e que em Maio de 2011 acabou por mudar-se para o Sporting Clube de Portugal vindo do Alianza Lima. Espera-se que este jogador tenha um grande sucesso no futebol europeu e também no Sporting Clube Portugal.', NULL),
(53, 5, 'Jogador', 'Bruno Alexandre Marques Pereirinha', 'Bruno Alexandre Marques Pereirinha é um futebolista actualmente no Sporting.', NULL),
(54, 5, 'Jogador', 'Valeri Emilov Bozhinov', 'Valeri Emilov Bozhinov - em búlgaro Валери Емилов Божинов - é um futebolista búlgaro. Joga atualmente no Parma da Itália, emprestado pelo Manchester City. Bojinov foi revelado pelo Lecce e lá se destacou, fazendo seu nome no clube. Antes de ser contratado pelo City teve passagens pela Fiorentina e pela Juventus. Na Seleção Búlgara de Futebol ajudou sua seleção a ir a UEFA Euro 2004 mas nem ele e nem Berbatov evitou que a seleção búlgara fosse eliminada ainda na fase de grupo do torneio.', NULL),
(55, 5, 'Jogador', 'Fabián Andrés Rinaudo', 'Bold text Fabián Rinaudo Personal information Full name Fabián Andrés Rinaudo Date of birth May 15, 1987 (1987-05-15) (age 24) Place of birth Armstrong, Argentina Height 1.76 m (5 ft 9 in) Playing position Defensive midfielder Club information Current club Sporting Clube de Portugal Number 21 National team caps and goals correct as of 18:26, 21 December 2010 (UTC). * Appearances (Goals) Fabián Andrés Rinaudo is an Argentinian football midfielder currently playing for Sporting Clube de Portugal in Portugal.', NULL),
(56, 5, 'Jogador', 'Alberto Junior Rodríguez Valdelomar', 'Alberto Junior Rodríguez Valdelomar é um futebolista peruano, que joga actualmente no Sporting Clube de Portugal. Assinou em Maio de 2011 pelo Sporting Clube de Portugal na sequência da contratação do treinador finalista da Liga Europa, Domingos Paciência.', NULL),
(57, 5, 'Jogador', 'Evaldo dos Santos Fabiano', 'Evaldo dos Santos Fabiano, é um futebolista brasieliro, que joga habitualmente a defesa esquerdo. Chegou ao futebol português na época 2003/2004, oriundo do Clube Atlético Paranaense, para defender as cores do FC Porto. Em Junho de 2008 assinou um contrato válido por 4 épocas pelo Sporting Clube de Braga.. A 16 de Junho de 2010 Evaldo dá o mais importante passo na sua carreira, transferindo-se para o Sporting Clube de Portugal (contratado por 4 anos). A transferência realiza-se por cerca de 3 milhões de euros.', NULL),
(58, 5, 'Jogador', 'João Pedro da Silva Pereira', 'João Pedro da Silva Pereira, nasceu em, jogador de futebol português. Cresceu no problemático bairro Casal Ventoso, mas conseguiu escolher o caminho do futebol como forma de ganhar a vida. Oriundo das escolas de formação do Sport Lisboa e Benfica, é internacional Sub-21 por Portugal. Normalmente alinha do lado direito,como defesa, embora em rasgos de fúria tome conta da lateral direita para imprimir a sua velocidade e assim ajudar a equipa no ataque. É conhecido pela sua extrema rebeldia em campo, jogando com amor à camisola e lutando para a vitória do colectivo com todas as suas forças. José António Camacho chamou-o, tendo vindo a marcar dois golos contra o Paços de Ferreira. Na temporada de 2004-2005 marcou um golo ao Beira Mar que veio a ajudar o Benfica a passar para a eliminatória seguinte da Taça de Portugal. O Estádio do Bessa fica marcado para João Pereira, uma vez que lá se estreou tanto no Campeonato Nacional como na Taça UEFA. Na época de 2006/07 actuou no Gil Vicente. No mercado de Inverno de 2009 foi contratado pelo Sporting CP.', 'true'),
(59, 5, 'Jogador', 'Simon Vukčević', 'Simon Vukčević é um futebolista montenegrino que joga no Sporting. Um dos jogadores mais impressionantes da recente história da Sérvia e Montenegro, Vukčević deu os primeiros xutos na bola no FK Budućnost Podgorica e aos 16 anos foi para a capital servia para a formação do Partizan. O pai do Simon, Ilija Vukčević, é director desportivo do FK Zeta.', NULL),
(60, 5, 'Jogador', 'Oguchi Onyewu', 'Oguchialu Chijioke Goma Lambu Onyewu, conhecido simplesmente como Oguchi Onyewu é um futebolista norte-americano que defendeu seu país nas Copas do Mundo da FIFA de 2006 e 2010 . Depois da sua passagem pelo Predefinição:Futebol Milan, joga atualmente no Sporting Clube de Portugal.', 'true'),
(61, 5, 'Jogador', 'Ânderson Corrêa Polga', 'Ânderson Corrêa Polga é um futebolista brasileiro. Polga joga normalmente como defesa central, e foi transferido no dia 16 de junho para o Barcelona por cerca de 15 Milhoes de euros. Iníciou sua carreira profissional no Grêmio. Suas atuações pelo Grêmio o levaram a disputar a Copa do Mundo de 2002 pela Seleção Brasileira. Transferiu-se para o Sporting em 2003, assinando um contrato de 3 anos (até 2006). Já depois disso teve duas renovações do contrato com o Sporting: a primeira que o ligou até Junho de 2009 (3 anos) e depois mais 3 anos (até 2012).', NULL),
(62, 5, 'Jogador', 'Marcelo Boeck', 'Marcelo Boeck (nascido a 28 de Novembro de 1984 em Vera Cruz) é um jogador de futebol brasileiro que joga actualmente no Sporting CP como guarda-redes.', NULL),
(63, 5, 'Jogador', 'Ricky van Wolfswinkel', 'Rick van Wolfswinkel; nascido a 27 de Janeiro de 1989 in Woudenberg) é um futebolista holandês que joga pelo Sporting CP e pelo selecção Holandesa. Ele é um jogador versátil, que pode jogar tanto como ponta-de-lança ou como médio de ataque, embora prefira jogar a ponta-de-lança.', 'true'),
(64, 5, 'Jogador', 'William Silva de Carvalho', 'William Silva de Carvalho (born 7 April 1992 in Luanda) is a Portuguese footballer who plays for Sporting Clube de Portugal, as a midfielder.', NULL),
(65, 5, 'Jogador', 'José Luís Mendes Lopes', 'José Lopes, best known as Zezinho, (born 23 September 1992 in Bissau) is a Bissau-Guinean footballer who plays as a Winger. He is currently playing for Sporting Clube de Portugal.', NULL),
(66, 5, 'Jogador', 'Diego Iván Rubio Köstner', 'Diego Iván Rubio Köstner (nascido a 17 de Maio 1993) é um jogador de futebol chileno que joga actualmente no Sporting CP e na selecção nacional chilena como avançado ou como médio-ofensivo. Ele é filho do antigo avançado do Colo-Colo Hugo Rubio e irmão dos futebolistas profissionais Eduardo Rubio e Matías Rubio. É também sobrinho da antiga estrela chilena Iván Zamorano e da sua mulher María Alberó.', 'true'),
(67, 5, 'Jogador', 'Santiago Arias Naranjo', 'Santiago Arias Naranjo is a Colombian footballer who plays for Sporting Clube de Portugal, and can either operate as a right defender or right midfielder.', NULL),
(68, 7, 'Jogador', 'Givanildo Vieira de Souza', 'Givanildo Vieira de Souza, mais conhecido como Hulk, é um futebolista brasileiro que atua como atacante. Actualmente joga pelo Porto. Nunca tendo sido prestigiado no Brasil, Hulk deixou o Vitória com apenas 18 anos e fez carreira no Japão, precisamente no Kawasaki Frontale, Tokyo Verdy e Consadole Sapporo, estabelecendo uma média de gols expressiva (no total, fez 74 gols em 111 jogos) e se destacando. Acabou se transferindo para o F.C. Porto em 2008, onde vem, desde então, chamando a atenção de outros grandes clubes europeus, principalmente pela temporada 2010-11 que fez no clube português, tendo marcado 36 gols em todas as competições e se sagrado artilheiro do Campeonato Português (23 para o Campeonato, além de 19 assistências).', 'true'),
(69, 7, 'Jogador', 'Mariano Nicolás González', 'Mariano Nicolás González é um futebolista argentino que actualmente joga no FC Porto. Jovem promessa do Campeonato Argentino, com uma grande velocidade e bom toque de bola ganhou, nos Jogos Olímpicos de Atenas 2004, a medalha de ouro, um dos momentos altos da sua carreira. Outro momento alto foi o ingresso no Inter.', NULL),
(70, 7, 'Jogador', 'Fernando Daniel Belluschi', 'Fernando Daniel Belluschi, é um futebolista argentino que começou sua carreira futebolística no Newell\\''s Old Boys em 2002, onde fez 90 jogos e marcou 20 gols; clube em que conquistou o Campeonato Argentino de Futebol (Torneio de Apertura). Em 2006 ele foi contratado pelo River Plate, onde foi capitão depois da negociação de Marcelo Gallardo com o PSG da França. Depois de dois anos no time argentino ele teve seus direitos adquiridos pelo grego Olympiacos pelo valor de € 6,5 milhões em 2008. Em 6 de julho de 2009, o FC Porto de Portugal comprou 50% de seu passe por € 5 milhões. A melhor posição de Belluschi é médio ofensivo, ou a jogar nas costas dos avançados como um elo entre o meio campo e o ataque. Ganhou a sua primeira Liga Europa ao serviço do Futebol Clube do Porto em 2011.', NULL),
(71, 7, 'Jogador', 'James David Rodríguez Rubio', 'James Rodriguez é um jogador colombiano de 19 anos que, recentemente, assinou contrato com o FC Porto, tendo então jogado anteriormente na equipe argentina do Banfield. Joga como extremo, mas consegue também facilmente jogar como Meio Campo Ofensivo. Com um excelente pé esquerdo, trata cada bola que recebe com elegância e critério sendo um jogador forte no 1 a 1. Foi um dos destaques do Banfield. É uma das maiores promessas do Futebol Sul-Americano. Em 2008, foi assinada por Argentina equipe do Clube Atlético Banfield, onde ele fez sua estréia no time principal em 07 de fevereiro de 2009, ele marcou seu primeiro gol pelo clube em 27 de Fevereiro com uma greve de longo alcance em uma vitória por 3-1 sobre o Rosario Central.', NULL),
(72, 7, 'Jogador', 'Henrique Sereno Fonseca', 'Henrique Sereno Fonseca é um futebolista português, que fez a sua formação nas camadas jovens do clube ''Os Elvenses'', o início da sua carreira de Sénior começou ao serviços do O Elvas. Actualmente joga no FC Porto após de ter terminado o tempo de contrato com o Real Valladolid.', 'true'),
(73, 7, 'Jogador', 'Josef de Souza Dias', 'Josef de Souza Dias, conhecido somente como Souza, é um futebolista brasileiro que atua como volante. Foi revelado pelo Vasco da Gama. Atualmente joga pelo Porto, de Portugal.', 'true'),
(74, 7, 'Jogador', 'Ionuţ Cristian Săpunaru', 'Ionuţ Cristian Săpunaru é um futebolista romeno que joga no FC Porto. Começou a jogar com 6 anos nas escolas de formação do FC Naţional, Sapunaru mudou-se para o Rapid Bucareste em Julho de 2006. Em Julho de 2008 transferiu-se para o FC Porto, €2.5 milhões por 50% do passe, enquanto o Rapid Bucareste treinado pelo José Peseiro recebe 2 jogadores emprestados - Claudio Pitbull e João Paulo. Sapunaru estreou-se na selecção romena em Maio de 2008, num jogo contra o Montenegro. Foi seleccionado para participar no Euro 2008, mas não chegou a jogar nenhuma partida.', 'true'),
(75, 7, 'Jogador', 'Jorge Ciro Fucile Perdomo', 'Jorge Ciro Fucile Perdomo é um futebolista uruguaio que atua na posição de lateral esquerdo ou direito. Começou a jogar futebol no Liverpool de Montevideo. Chegou à 1ª equipa em 2005, tendo dado nas vistas. Oscar Tabárez, seleccionador uruguaio, levou-o a um torneio na Tunísia, onde os Uruguaios levaram a melhor. Em agosto deste ano surgiu a possibilidade de vir emprestado para o FC Porto. Nesta altura também se falou na possibilidade de o jogador ser contratado pelo Nacional de Montevideo e pelos Argentinos do Boca Juniors. Está ao serviço do FC Porto, cedido a título de empréstimo pelo Liverpool de Montevideo de Montevideu. O contrato realizado entre os dois clubes fez com que o FC Porto despendesse de 200 mil Euros, ficando com opção de compra no final deste despendendo de mais 400 mil euros. A estreia de Jorge Fucile acontece na sequência de problemas disciplinares de José Bosingwa, que tinha sido titular na posição de lateral direito. Fucile actuou os 90 minutos frente ao Hamburgo, na Liga dos Campeões. Integra o elenco da Seleção Uruguaia de Futebol que disputa a Copa do Mundo FIFA de 2010.', 'true'),
(76, 7, 'Jogador', 'António Alberto Bastos Pimparel', 'António Alberto Bastos Pimparel, mais conhecido apenas como Beto, é um futebolista português, que joga habitualmente a guarda-redes. Formou-se nas escolas do Predefinição:PtSP e jogou em vários clubes dos diversos escalões do futebol português. Em 2006 ingressou no Leixões Sport Club onde fez uma época de grande destaque em 2008/09. No final dessa época foi contratado pelo Futebol Clube do Porto. Em 10 de Maio de 2010 foi convocado para representar a Selecção Portuguesa de Futebol no Campeonato do Mundo África do Sul 2010 como 2º guarda-redes. Porém não tomou parte em jogo algum com Eduardo a ser titular em todos os quatro jogos. . Predefinição:Referências', NULL),
(77, 7, 'Jogador', 'Radamel Falcao García Zárate', 'Radamel Falcao García Zárate é um futebolista colombiano. Actualmente joga no FC Porto, em Portugal. O jogador também é convocado com frequência para defender a Seleção Colombiana. O FC Porto e o River Plate chegaram a acordo, com a mediação do empresário Marcelo Simonian, e a oficialização da contratação de Falcao. O contrato prevê um vínculo por 4 anos com o jogador. No seu primeiro ano a disputar a Liga dos Campeões, Falcao marcou 4 golos, sendo um deles de calcanhar ao Atlético de Madrid, ainda na fase de grupos. É actualmente o melhor marcador de sempre do FC Porto nas competições europeias, contabilizando 22 golos.', 'true'),
(78, 7, 'Jogador', 'Helton da Silva Arruda', 'Hélton da Silva Arruda, mais conhecido como Hélton, é um futebolista brasileiro que atua como goleiro. Joga atualmente pelo Porto.', 'true'),
(79, 7, 'Jogador', 'Rui Gil Soares de Barros', 'Rui Gil Soares de Barros foi um dos melhores futebolistas portugueses da sua geração. Barros foi campeão nacional de juniores pelo FC Porto em meados da década de 80. No seu percurso juvenil vestira as camisolas do Aliados de Lordelo, o clube da sua terra, do Rebordosa e do Paços de Ferreira. A exemplo de outros, não teve a sorte de subir imediatamente à equipa principal, tendo sido emprestado, para rodar, ao Covilhã (2ª Divisão) e ao Varzim. Ao serviço deste último sagrou-se campeão da Zona Norte da 2ª Divisão. Regressou ao seu clube de coração na ressaca da conquista da Taça dos Campeões Europeus. Lançado por Tomislav Ivic, contribuiu para as vitórias na Taça Intercontinental e na Supertaça Europeia. Neste último jogo, marcou mesmo o único golo com que o F.C. Porto derrotou o Ajax, na primeira-mão, na Holanda. Este golo, obtido após uma abertura de Gomes, isolando-o na cara do guarda-redes, resumiu as qualidades que fizeram dele um jogador de eleição na Europa: a rapidez e a técnica. Foi com naturalidade que assinou pela Juventus. Jogou lá dois anos e ainda hoje é considerado uma das velhas glórias da vecchia signora. Em 95 jogos (incluindo campeonato, taça e provas europeias) fez 19 golos, tendo ganho uma Taça de Itália e uma Taça Uefa. Entre 1990 e 1993 jogou no Mónaco (ao lado de George Weah) de Arsène Wenger, ao serviço do qual marcou 4 golos na Taça das Taças, contribuindo para a ida à final, que acabaria por perder para o Werder Bremen, em 1992. Na época de 93/94 jogou no Marselha (com Futre), antes de regressar ao FC Porto para ser um dos obreiros do futuro PENTA-campeonato. Foi internacional por 36 vezes (desde 1987 a 1996) e marcou 4 golos ao serviço da selecção.', 'true'),
(80, 7, 'Jogador', 'Enoch Ebo Andoh', 'Enoch Ebo Andoh (born on 01 January 1993 in Kumasi) is a Ghanaian football, he currently plays for F.C. Porto.', 'true'),
(81, 7, 'Jogador', 'Djalma Braume Manuel Abel Campos', 'Djalma Braume Manuel Abel Campos é um futebolista de Angola.', NULL),
(82, 7, 'Jogador', 'Alex Sandro Lobo Silva', 'Alex Sandro Lobo Silva, mais conhecido como Alex Sandro, é um futebolista brasileiro. Atualmente, joga no Santos.', NULL),
(83, 7, 'Jogador', 'Emídio Rafael Augusto Silva', 'Emídio Rafael Augusto Silva é um futebolista português, mais conhecido por Rafa que joga habitualmente a defesa esquerdo.', NULL),
(84, 7, 'Jogador', 'André Castro Pereira', 'André de Castro Pereira, mais conhecido por Castro, nasceu a 2 de Abril de 1988 na cidade de Gondomar, Distrito do Porto. Futebolista português que joga em qualquer posição do meio-campo. Na época (2010/11), esteve os primeiros seis meses no FC Porto, jogando nas campanhas que redundaram nas conquistas da Liga Portuguesa, na Taça de Portugal e a Liga Europa, passando a segunda metade da época no Sporting de Gijón, contribuindo para a permanência da equipa na Liga Espanhola.', NULL),
(85, 7, 'Jogador', 'Rúben Micael Freitas Ressureição', 'Rúben Micael Freitas da Ressurreição é um futebolista português. É um médio atacante oriundo da União da Madeira que passou pelo Nacional da Madeira e está agora a jogar ao serviço do FC Porto. No dia 18 de Janeiro de 2010 foi contratado pelo Futebol Clube do Porto, que pagou 3 milhões € por 60% do seu passe, tendo assinado um contrato de 4 anos e meio. Trilhou o seu caminho no Nacional da madeira, tendo contribuído para a conquista do 4º lugar do campeonato em 2008/2009.', 'true'),
(86, 7, 'Jogador', 'Samir Badr', 'Samir Badr (born April 2, 1992 in Fairfax, Virginia) is an American soccer player playing for FC Porto in the Primeira Liga.', NULL),
(87, 7, 'Jogador', 'Fernando Francisco Reges', 'Fernando Francisco Reges é um futebolista brasileiro que atua como volante. Atualmente, joga pelo Porto.', 'true'),
(88, 7, 'Jogador', 'Hugo Miguel Almeida Costa Lopes', 'Hugo Miguel Almeida Costa Lopes é um futebolista português, internacional sub-21 por 2 vezes, que actualmente habitualmente a defesa-direito. Miguel Lopes começou a sua carreira ainda novo no Benfica, tornando-se um produto das camadas jovens e poucos anos depois é promovido à equipa B. Mas na época seguinte a equipa B do Benfica extinguiu-se e teve de ingressar no Operário, um clube de um escalão inferior, onde realizou excelentes exibições, transferindo-se para o Rio Ave em 2007, na altura na Liga de Honra, revelando-se como primeira escolha para a posição de defesa-direito, onde disputou 24 jogos e apontou 2 golos, ajudando a equipa a ser promovida para a Liga Sarges. Na época seguinte de 2008-2009 ajudou o Rio Ave a ter um bom arranque na Liga Sagres, com empates caseiros contra os grandes Benfica e FC Porto, fazendo boas exibições, chamando a atenção do Benfica, FC Porto e outros clubes europeus para uma futura transferência em Janeiro. Em 22 de Janeiro de 2009 assinou contrato com o Futebol Clube do Porto, e é jogador do clube desde 1 de Julho, este negócio envolveu também o empréstimo imediato dos jogadores Edson e Candeias ao Predefinição:PtRA.', NULL),
(89, 7, 'Jogador', 'Kelvin Mateus de Oliveira', 'Kelvin Mateus de Oliveira, ou simplesmente Kelvin, é um jogador de futebol brasileiro que atua como meio-campista e atacante.', NULL),
(90, 7, 'Jogador', 'Kléber Laude Pinheiro', 'Kléber Laube Pinheiro, ou simplesmente Kléber é um futebolista brasileiro que joga pelo Porto. É atacante e jogou nas categorias de base do Atlético Mineiro de 2007 a 2009.', NULL),
(91, 7, 'Presidente', 'Pinto da Costa', 'Jorge Nuno de Lima Pinto da Costa é o presidente do Futebol Clube do Porto desde 1982.', NULL),
(92, 7, 'Treinador', 'Vítor Manuel Oliveira Lopes Pereira', 'Vítor Manuel de Oliveira Lopes Pereira, mais conhecido por Vítor Pereira, é um treinador de futebol português. Actualmente treina o FC Porto. É o sucessor de André Villas-Boas na época 2011/2012, tendo assinado no dia 21 de Junho de 2011.', NULL),
(93, 8, 'Jogador', 'Joaquim Manuel Sampaio Silva', 'Joaquim Manuel Sampaio Silva mais conhecido por Quim, é um guarda-redes de futebol português, que actualmente representa o Sporting Clube de Braga. Quim sagrou-se campeão nacional pelo Benfica em 2009/10 e foi sabido pelo ex-treinador Jorge Jesus, em entrevista do programa desportivo Trio d\\''Ataque, que não iria mais representar o Benfica, não sendo assim renovado o contrato que terminou em Junho de 2010.', NULL),
(94, 8, 'Jogador', 'Alan Osório da Costa Silva', 'Alan Osório da Costa Silva é um futebolista luso-brasileiro, casado com a portuguesa Paula Mordomo Silva do qual resultam dois filhos nascidos em portugal. Actualmente está num clube Português, o Sporting Clube de Braga, clube com que assinou um contrato válido por três épocas em Julho de 2008.', NULL),
(95, 8, 'Jogador', 'Nuno André Silva Coelho', 'Não confundir com Nuno Miguel Prata Coelho. Predefinição:Info/Futebolista Nuno André da Silva Coelho mais conhecido por Nuno André, é um futebolista Português, que joga habitualmente a defesa. Enquanto jogador do Futebol Clube do Porto esteve emprestado a vários clubes; em que em 2008/2009 esteve ao serviço do Clube de Futebol Estrela da Amadora, voltando no final da mesma época para o Futebol Clube do Porto. Representou a selecção nacional nas suas várias camadas por diversas vezes (num total de 28 partidas), tendo sido convocado na primeira convocatória do escalão sub-23, em Outubro de 2009 A 4 de Julho de 2010, foi confirmada a sua saída para o Sporting, em troca de João Moutinho, capitão do Sporting Foi recentemente anunciada a sua convocatória para a estreia da Selecção Portuguesa na Qualificação para o Campeonato da Europa de 2012, contra o Chipre. Predefinição:Quote2 .', NULL),
(96, 8, 'Jogador', 'Vanderson Válter de Almeida', 'Vanderson Válter de Almeida, mais conhecido como Vandinho, é um futebolista brasileiro, que joga actualmente no Sporting Clube de Braga.', NULL),
(97, 8, 'Jogador', 'André Filipe Alves Monteiro', 'André Filipe Alves Monteiro (born 16 March 1988), aka Ukra, is a Portuguese footballer who plays for S.C. Braga on loan from F.C. Porto, mainly as a forward.', NULL),
(98, 8, 'Jogador', 'Douglas de Oliveira', 'Douglas de Oliveira, mais conhecido como Douglas, é um futebolista brasileiro que atua como atacante. Atualmente, joga pelo Vitória de Guimarães.', NULL),
(99, 8, 'Jogador', 'José Luís Mendes Andrade', 'José Luís Mendes Andrade (born 24 January 1991 in Fogo), aka Zé Luís, is a Cape Verdean footballer who plays for S.C. Braga as a striker.', NULL),
(100, 8, 'Jogador', 'Nuno Miguel Soares Pereira Ribeiro', 'Nuno Miguel Soares Pereira Ribeiro, mais conhecido por Nuno Gomes, é um futebolista português que joga na posição de avançado. Representou a Selecção Portuguesa de Futebol 77 vezes, o que faz dele o nono jogador mais internacional de sempre pela Selecção das Esquinas. Em 2008, tornou-se no quarto jogador a marcar em 3 Campeonatos Europeus seguidos: Euro 2000, Euro 2004 e Euro 2008. Também já representou as Quinas no Mundial de 2002 e Mundial 2006. É o quarto melhor marcador de sempre da Selecção Nacional com 29 golos em 77 partidas, sendo superado apenas por Pauleta (47 golos), Eusébio (41) e Figo (32). Mudou o seu último nome (profissional) em homenagem ao seu ídolo de infância Fernando Gomes, antigo jogador do Futebol Clube do Porto.', 'true'),
(101, 8, 'Jogador', 'Djamal Abdoulaye Mahamat Bindi', 'Djamal Abdoulaye Mahamat Bindi جمال محمد بيندي is a Libyan international footballer who currently plays in the Portuguese Liga for SC Braga as well as the Libyan national team where he plays in Midfield. He was born to a Libyan mother and Chadian father whose family had settled in Libya.', NULL),
(102, 8, 'Jogador', 'Custódio Miguel Dias Castro', 'Custódio Miguel Dias de Castro é um jogador de futebol português que joga habitualmente a médio defensivo. Custódio ascendeu ao plantel principal do Sporting na época de 2003/2004 depois de ter sido adquirido ao Vitoria de Guimarães em 2001 para representar a equipa B do Sporting, e representou da Selecção Portuguesa de Sub-21 nos Campeonato Europeu de Futebol Sub-21 de 2004 e 2006. Custodio sagrou se campeao nacional 2001-2002 com sporting tendo sido convocado ainda jovem para alguns encontros mas jogando 9 minutos contra o salgueiros.... em 2006 2007 venceu a taca de portugal epoca em que era capitao de equipa... tendo ainda em 2005 sido um dos jogadoress que mais golos fez na caminha ate a final da taça uefa (3) No início da temporada 2007-2008, Custódio foi designado o capitão da equipa de futebol do Sporting Clube de Portugal, tendo no mercado de inverno transferido para o Dínamo de Moscovo, do Campeonato Russo de Futebol. Esta exprincia foi mal sucedida devido a inadaptacao tal como muitos portugueses,tendo jogado 8 jogos pelo dinamo... Em janeiro de 2009 regressa ao Portugal para representar o Vitória Sport Clube, num contrato válido por três épocas e meia.. No dia 31 de Agosto de 2010 troca o Vitoria de Guimaraes pelo rival Sporting Clube de Braga.', 'true'),
(103, 8, 'Jogador', 'José Márcio da Costa', 'José Márcio da Costa, mais conhecido como Márcio Mossoró ou simplesmente Mossoró, é um futebolista brasileiro que atua como meia. Atualmente, joga pelo Braga.', NULL),
(104, 8, 'Jogador', 'Sebastião Marcos Barbosa Oliveira', 'Sebastião Marcos Barbosa Oliveira, mais conhecido como Marcos, é um futebolista brasileiro que atua como goleiro. Atualmente, joga no Predefinição:PtBR.', NULL),
(105, 8, 'Jogador', 'Marco Miguel Gonçalves Ramos', 'Marco Miguel Gonçalves Ramos (born 26 April 1983 in Levallois-Perret) is a French-born Portuguese footballer who plays for S.C. Braga as a left defender.', NULL),
(106, 8, 'Jogador', 'Joseph Peterson', 'Joseph Peterson, (born 24 April 1990) is a Haitian football (soccer) player, who currently plays as a center midfielder for Portuguese Liga side SC Braga. Known for having a soft touch on the ball and playing quick one to two touch passes throughout the field, Peterson is known as the Haitian \\"Xavi\\".', NULL),
(107, 8, 'Jogador', 'Rodrigo José Lima dos Santos', 'Rodrigo José Lima dos Santos, mais conhecido como Lima, é um jogador brasileiro de futebol que atua como atacante. Atualmente defende o Predefinição:Futebol Sporting de Braga.', NULL),
(108, 8, 'Jogador', 'Tommaso Berni', 'Tommaso Berni é um futebolista italiano que atualmente joga no SC Braga.', NULL),
(109, 8, 'Jogador', 'Emmanuel Imorou', 'Emmanuel Imorou is a naturalized Beninese football midfielder, who plays for Portuguese club S.C. Braga.', NULL),
(110, 8, 'Jogador', 'Paulo César Rocha Rosa', 'Paulo César Rocha Rosa é um futebolista brasileiro, que joga habitualmente como avançado. Em Junho de 2008 assinou um contrato válido por 2 épocas pelo Sporting Clube de Braga.', NULL),
(111, 8, 'Jogador', 'Hélder Jorge Leal Rodrigues Barbosa', 'Hélder Jorge Leal Rodrigues Barbosa é um futebolista português, sendo considerado uma das maiores esperanças do plantel do FC Porto e do futebol português. Alinhando normalmente na equipa B do FC Porto, passou a meio da época de 2005/06 a fazer parte do plantel principal às ordens do técnico Co Adriaanse. É um esquerdino que actua normalmente junto à faixa primando pela rapidez e excelente toque de bola. Efectuou o seu jogo oficial de estreia pela equipa principal do FC Porto em 6 Maio 2006 contra o Boavista FC onde acabou por ser expulso pelo árbitro Pedro Henriques por acumulação de amarelos. Na época passada foi emprestado a Académica,onde participou em poucos jogos oficiais, devido a uma grave lesão em Novembro de 2006,que o afastou dos relvados durante o resto da temporada. Já recuperado para esta temporada,a Académica voltou a requisitar o jogador ao Porto novamente por empréstimo. E O Porto acedeu,(apesar de terem sido vários os interessados nos seus serviços,como por exemplo Nacional da Madeira e Panathinaikos. Em Janeiro de 2008, Hélder Barbosa é o resultado da primeira incursão do FCPorto no mercado de inverno, regressando assim á sua \\"casa\\" mais maduro. Em Julho de 2008 mudou-se para o Clube Desportivo Trofense, por empréstimo do Futebol Clube do Porto, durante uma época. No início da época seguinte foi novamente emprestado, desta vez, ao Vitória de Setúbal. Representou a selecção nacional nas suas várias camadas por diversas vezes, tendo sido convocado na primeira convocatória do escalão sub-23, em Outubro de 2009. É considerado um dos melhores jogadores da actualidade na sua categoria.', NULL);
