(112, 8, 'Jogador', 'Uwa Elderson Echiéjilé', 'Uwa Elderson Echiejile é um futebolista nigeriano que atua como lateral-esquerdo. Atualmente, defende o Sporting Clube de Braga.', NULL),
(113, 8, 'Jogador', 'Leandro Salino do Carmo', 'Leandro Salino do Carmo, mais conhecido como Leandro Salino, é um futebolista brasileiro, que joga actualmente no Braga de Portugal. Foi conhecido por ser o maior ladrão de bolas no campeonato brasileiro de 2008.', NULL),
