(116, 8, 'Jogador', 'Ewerton José Almeida Santos', 'Ewerton José Almeida Santos (born 23 March 1989) is a Brazilian footballer who plays for S.C. Braga as a central defender. Corinthians (AL) loaned the player until June 2013.', NULL),
(117, 8, 'Jogador', 'Luís Miguel Afonso Fernandes', 'Luís Miguel Afonso Fernandes (born 6 October 1989 in Bragança), aka Pizzi, is a Portuguese footballer who plays for S.C. Braga as a forward.', NULL),
(118, 8, 'Jogador', 'Nuno Henrique Gonçalves Nogueira', 'Nuno Henrique Gonçalves Nogueira (born 19 October 1986 in Fafe), known as Henrique, is a Portuguese footballer who plays for S.C. Braga as a central defender.', NULL),
(119, 8, 'Jogador', 'Nuno Daniel Costeira Valente', 'Nuno Daniel Costeira Valente (born 22 November 1991 in Adaúfe - Braga) is a Portuguese footballer who plays for S.C. Braga, as a midfielder.', NULL),
(120, 8, 'Treinador', 'José Leonardo Nunes Alves S. Jardim', 'José Leonardo Nunes Alves Sousa Jardim, é um treinador de futebol português da primeira liga, que atualmente comanda o Predefinição:PtBR.', NULL),
(121, 9, 'Jogador', 'Kristijan Brčić', 'Kristijan Brčić (born 17 July 1987 in Zagreb) is a Croatian football, who currently plays for NK Trnje Zagreb.', NULL),
(122, 9, 'Jogador', 'Claudemir Ferreira da Silva', 'Claudemir Ferreira da Silva (born 17 August 1984) is a Brazilian footballer who plays for Nacional (POR). Claudemir started his career at Vasco da Gama and played at Campeonato Brasileiro.', NULL),
(123, 9, 'Jogador', 'Luís Carlos Novo Neto', 'Luís Carlos Novo Neto é um futebolista português que joga habitualmente como defesa. É um dos jovens mais promissores das nossas selecções jovens,tendo sido sondado ainda jovem por vários clubes de grande nome europeu. Actualmente disputa a Liga Vitalis como defesa, utilizando o número 2 na sua camisola e representa o Varzim Sport Club.', NULL),
(124, 9, 'Jogador', 'Tomasevic, Zarko', 'Žarko Tomašević is a Montenegrin footballer who plays for C.D. Nacional in the Portuguese first division, as a central defender.', NULL),
(125, 9, 'Jogador', 'Danijel Stojanović', 'Danijel Stojanović is a Croatian footballer, who plays for Portuguese first division side Nacional, having been signed from Zrinjski Mostar.', NULL),
(126, 9, 'Jogador', 'Mario Junior Rondón Fernández', 'Mario Junior Rondón Fernández (born 26 March 1986 in Caracas) is a Venezuelan footballer who plays for C.D. Nacional in Portugal, as a striker.', NULL),
(127, 9, 'Jogador', 'Nuno Miguel Sousa Pinto', 'Nuno Miguel Sousa Pinto is a Portuguese footballer who plays for C.D. Nacional as a left defender.', NULL),
(128, 9, 'Jogador', 'Luís Alberto Santos dos Santos', 'Luís Alberto Santos dos Santos, ou simplesmente Luís Alberto é um futebolista brasileiro. Atualmente atua como volante pelo Nacional. É considerado uma grande revelação do Bahia.', NULL),
(129, 9, 'Jogador', 'Dejan Školnik', 'Dejan Školnik (born 1 January 1989 in Maribor), is a Croatian football midfielder who currently plays for Portuguese first division club C.D. Nacional and for the Croatian under-21 team.', NULL),
(130, 9, 'Jogador', 'João Miguel Coimbra Aurélio', 'João Miguel Coimbra Aurélio (born 17 August 1988 in Beja) is a Portuguese footballer who plays for C.D. Nacional in the Portuguese first division, as a midfielder.', NULL),
(131, 9, 'Jogador', 'Elisson Aparecido Rosa', 'Elisson Aparecido Rosa é um futebolista brasileiro que atua cvomo goleiro. Atualmete defende o Nacional da Madeira.', NULL),
(132, 9, 'Jogador', 'José Edgar Andrade Costa', 'José Edgar Andrade Costa is a Portuguese footballer who plays for C.D. Nacional as a forward.', NULL),
(133, 9, 'Jogador', 'Daniel João Santos Candeias', 'Daniel João Santos Candeias ou simplesmente Candeias é um jogador de futebol português,nascido a 25 de Fevereiro de 1988, natural de Fornos de Algodres, distrito da Guarda. Jogador com uma enorme velocidade e força fisica, começou a jogar pelo Fornos de Algodres onde o seu talento não passou despercebido e foi transferido com 14 anos para o Futebol Clube do Porto. Jogou em todas as equipas do futebol de formação do Porto tendo recebido o prémio de melhor jogador europeu sub 15 num torneio organizado pela nike. Alem de todos os feitos pelo Futebol Club do Porto, é presença assidua em todos os escalões das Selecções de Esperanças de Portugal onde se exibe sempre com distinção e onde conta já com 49 intercionalizações e 20 golos. Foi internacional sub-19 por Portugal no Europeu na Austria onde se exibiu a bom nível. Jogou esta época, emprestado pelo FC Porto, no Varzim Sport Club onde completou a sua primeira epoca como senior. Quase sempre titular no Varzim fez uma grande época e foi ainda o melhor jogador da final da Taça da Liga Intercalar onde marcou o golo da vitória. Recebeu ainda o prémio de melhor jogador jovem da Liga Vitalis no mês de Março. É uma das grandes promessas do futebol português numa zona muito limitada depois da retirada de Pedro Pauleta. Actualmente encontra-se ao serviço do Predefinição:PtRA de Portugal por empréstimo do Futebol Clube do Porto, detentor do seu passe, envolvido no negócio da contratação de Miguel Lopes. No início da época 2009/2010 foi anunciado o seu empréstimo ao Recreativo, do campeonato espanhol. Predefinição:Ref-section', NULL),
(134, 9, 'Jogador', 'Marcelo dos Santos Farias Valverde', 'Marcelo dos Santos Farias Valverde, better known as Marcelo Valverde (born November 21, 1989 Rio de Janeiro), is a Brazilian goalkeeper who plays for Portuguese Primeira Liga side Nacional.', NULL),
(135, 9, 'Jogador', 'Arthur Henrique Ricciardi Oyama', 'Arthur é um futebolista brasileiro que joga pelo Santo André como lateral-esquerdo.', NULL),
(136, 10, 'Presidente', 'Gil Vicente Futebol Clube', 'O Gil Vicente Futebol Clube é uma agremiação desportiva de Barcelos. Dedica-se ao futebol e a sua equipa principal vai disputar a 1ª Liga.', NULL),
(137, 10, 'Treinador', 'Paulo Lourenço Martins Alves', 'Paulo Lourenço Martins Alves (born 10 December 1969) is a retired Portuguese footballer who played as a centre forward, and a current coach.', NULL),
(138, 11, 'Jogador', 'Pedro Miguel Câmara Pinheiro', 'Pedro Miguel da Câmara Pinheiro is a Portuguese footballer who plays for C.D. Feirense as a midfielder.', NULL),
(139, 11, 'Jogador', 'William Augusto Alves Conserva', 'William Augusto Alves Conserva, known as William Alves, is a Brazilian footballer who currently plays for Portuguese side CD Feirense in the position of defender.', NULL),
(140, 11, 'Jogador', 'Mario Leandro Silva Galhano', 'Mario Leandro Silva Galhano born on 4 August 1982 Águeda, Portugal is a Portuguese footballer currently playing in the Liga de Honra club Feirense as a Defender wearing the number 3 shirt. He has been at the club seen 2001 were he was a successful youth product and went through the ranks to the first team were he is the current team captain and one of the key players in the squad.', NULL),
(141, 11, 'Jogador', 'Tiago André Coelho Lopes', 'Tiago André Coelho Lopes, mais conhecido por Rabiola, nasceu a 25 de Julho de 1989 é um futebolista português que joga a Ponta-de-lança, e também pode actuar como segundo avançado, assim como ir para as linhas, devido a sua velocidade e bom passe. Foi contratado pelo Porto na época 2007/2008 ao Guimarães e emprestado ao mesmo para ganhar rodagem, agora que o Guimarães voltou a primeira liga. Rabiola nos juniores do Vitória Sport Clube marcou mais de 50 golos ao longo dos anos . No início da segunda volta do campeonato o Porto \\"chamou\\" o jogador de volta, e na época seguinte foi emprestado ao Predefinição:PtOL.', NULL),
(142, 11, 'Jogador', 'Paulo Jorge Pedro Lopes', 'Paulo Jorge Pedro Lopes é um futebolista português, que joga habitualmente a guarda-redes. Já actuou em diversos clubes dos vários escalões do futebol português. No início da época 2009/2010 deixou o Clube Desportivo Trofense, para representar o Clube Desportivo Feirense.', NULL),
(143, 11, 'Jogador', 'Élvis Alves Pereira', 'Élvis Alves Pereira, é um futebolista brasileiro que joga habitualmente a defesa. Estreou-se no futebol português ao serviço do Leixões Sport Club em 2004; clube que representou até 2009. No início da época 2009/2010 o Predefinição:PtFR anunciou a sua contratação.', NULL),
(144, 11, 'Jogador', 'Diogo Jorge Rosado', 'Diogo Jorge Rosado (born 21 February 1990 in Peniche) is a Portuguese footballer who plays for C.D. Feirense on loan from Sporting Clube de Portugal, as a midfielder.', NULL),
(145, 11, 'Jogador', 'Valery Douglas Pajetat', 'Valery Douglas Pajetat (born 17 February 1986 in Yaoundé) is a Cameroonian footballer who plays for C.D. Feirense in Portugal, as a goalkeeper.', NULL),
(146, 11, 'Jogador', 'Alexandre Ludovic Ribeiro Pereira', 'Alexandre Ludovic Ribeiro Pereira, known as Ludovic, is a Portuguese footballer who plays for C.D. Feirense as a midfielder.', NULL),
(147, 11, 'Jogador', 'Roberto Alcântara Ballesteros', 'Roberto Alcântara Ballesteros, mais conhecido como artilheiro Roberto, é um futebolista brasileiro, que joga habitualmente a avançado. No início da época 2009/2010 deixou o Leixões Sport Club, para representar o Clube Desportivo Feirense.', NULL),
(148, 11, 'Jogador', 'Hélder Fernando Ferreira Castro', 'Hélder Fernando Ferreira de Castro (born 24 January 1986 in Fiães) is a Portuguese footballer who plays for C.D. Feirense as an attacking midfielder.', NULL),
(149, 12, 'Jogador', 'Patrick Fabionn Lopes', 'Patrick Fabionn Lopes é um futebolista brasileiro, que joga actualmente na União Desportiva de Leiria.', NULL),
(150, 12, 'Jogador', 'Diogo Carlos Correia Amado', 'Diogo Carlos Correia Amado is a Portuguese footballer who plays for U.D. Leiria, as a midfielder.', NULL),
(151, 12, 'Jogador', 'Yvan Erichot', 'Yvan Erichot (born 25 March 1990 in Chambray-les-Tours) is a French football player who plays for União Desportiva de Leiria in Portugal on loan from AS Monaco FC. He can play as either a centre back or a right back. On 26 June 2010, Erichot signed his first professional contract after agreeing to a three-year deal with Monaco. The following month, he was loaned to Clermont. Erichot made his professional debut with Clermont on 13 August 2010 in a league match against Dijon. He appeared as a half-time substitute in a 2–2 draw.', NULL),
(152, 12, 'Jogador', 'Paulo Vinícius de Souza Nascimento', 'Paulo Vinícius de Souza Nascimento é um futebolista brasileiro, que joga habitualmente como médio. Na segunda metade da época 2007/2008 esteve a jogar no Sporting Clube Olhanense, emprestado pelo Leixões Sport Club. No final da época a União Desportiva de Leiria comprou o seu passe.', NULL),
(153, 12, 'Jogador', 'Saïdou Madi Panandétiguiri', 'Saïdou Madi Panandétiguiri é um futebolista burquinense que atua no União de Leiria. Atuou também pelo time B do Bordeaux, Lokeren e Wehen.', NULL),
(154, 12, 'Jogador', 'Marcos Paulo Gelmini Gomes', 'Marcos Paulo Gelmini Gomes known as M. Paulo or Marcos Paulo (born 13 July 1988) is a Brazilian footballer who plays for União de Leiria. He also holds Italian nationality through descent.', NULL),
(155, 12, 'Jogador', 'Luiz Carlos Oliveira de Bitencourt', 'Luiz Carlos Oliveira de Bitencourt (born May 24, 1988, in Porto Alegre), is a Brazilian goalkeeper who is currently playing for U.D. Leiria in the Portuguese Portuguese Primeira Liga.', NULL),
(156, 12, 'Jogador', 'José António dos Santos Silva', 'José António dos Santos Silva, é conhecido como, Zé António, é um jogador profissional de futebol Português, de Torres Vedras, Portugal. José António, começou como jogador profissional em vários clubes portugueses, incluindo o FC Alverca, Varzim SC e mais tarde o Académica de Coimbra. Passou algum tempo na academia (de formação) de uma equipa de topo da Superliga, o FC Porto, ele consegui um punhado de internacionalizações nos Sub-21 de Portugal. Evitando a descida da Académica da Superliga, no final da temporada de 2004-2005, ele viu vantagem em sair para o Borussia Mönchengladbach, na Bundesliga, alemã, num negocio que o ligaria inicialmente ao clube por duas temporadas. Em 2007/2008 jogou por empréstimo no Manisaspor, do Campeonato Turco de Futebol. Em Junho de 2008 assinou por duas épocas pelo Racing Santander; clube que deixou no final de 2009 por salários em atraso em Janeiro de 2010 e assinou pela União de Leiria.', 'true'),
(157, 12, 'Jogador', 'Bruno dos Santos Moraes', 'Bruno dos Santos Moraes. É um futebolista Brasileiro que actualmente está ao serviço do Predefinição:PtST, da Campeonato português de futebol. Alguns dos clubes anteriores são: Vitoria FC. Ele pode jogar como avançado-centro, ou ponta-de-lança.', 'true'),
(158, 12, 'Jogador', 'Miloš Obradović', 'Miloš Obradović is a Serbian football player currently playing for Serbian First League club FK Mladost Lučani.', NULL),
(159, 12, 'Jogador', 'Jorge Miguel Feijoca Chula', 'Jorge Miguel Feijoca Chula (born 13 February 1990), commonly known as Jorge Chula, is a Portuguese footballer who plays as a winger or a forward for Portuguese Liga club U.D. Leiria.', NULL),
(160, 12, 'Jogador', 'Marco Paulo Silva Soares', 'Marco Paulo Silva Soares é um futebolista português de origem cabo-verdiana, que joga habitualmente a médio. Depois de uma época ao serviço do CS Pandurii Lignitul Târgu Jiu da Liga 1 do campeonato romeno de futebol, regressou ao Campeonato Português de Futebol para jogar na União Desportiva de Leiria.', NULL),
(161, 12, 'Jogador', 'Hugo André Viriato Santos Gomes', 'Hugo André Viriato Santos Gomes is a Portuguese footballer who plays for U.D. Leiria as a right defender.', NULL),
(162, 12, 'Jogador', 'Serge Charles N\\''Gal', 'Serge Charles N\\''Gal é um futebolista camaronês, que joga habitualmente a avançado. Depois de ter actuado no futebol português na União Desportiva de Leiria, mudou-se para o Nàstic, do campeonato espanhol.', NULL),
(163, 12, 'Jogador', 'Diego \\"Gaúcho\\" Goldim', 'Diego Gaúcho (born 15 November 1981 in Porto Alegre) is a Brazilian footballer who plays for the Portuguese team U.D. Leiria as a defender. Previously he played for Gil Vicente F.C. and in the first half of 2011 for the Romanian Liga I team FC Braşov.', NULL),
(164, 12, 'Jogador', 'Zhang Chengdong', 'Chengdong Zhang é um futebolista chinês, que joga atualmente no Mafra, como avançado. A familia de Zhang tem um bazar no Martim Moniz, onde é possivel encontrar bisnagas,pomada e berlindes. Zhang ficára na história na noite em que marcou 3 golos ao Predefinição:PtSP, num jogo da V eliminatória da taça de Portugal, mas o Mafra não consegui passar a eliminatória apesar da eficácia ofensiva de Zhang. Predefinição:Ref-section', NULL),
(165, 12, 'Jogador', 'Paulo Sérgio Ferreira Gomes', 'Paulo Sérgio Ferreira Gomes, known as Paulo Sérgio, is a Brazilian footballer who plays for U.D. Leiria in Portugal, as a defensive midfielder.', NULL),
(166, 12, 'Jogador', 'Rúben Luís Maurício Brígido', 'Rúben Luís Maurício Brígido (born 23 June 1991 in Leiria) is a Portuguese footballer who plays for U.D. Leiria, as a central midfielder.', NULL),
(167, 12, 'Jogador', 'Josias Basso Lisboa', 'Josias Basso Lisboa (born 14 April 1989) is a Brazilian footballer, who currently plays for U.D. Leiria as a defender. Basso also holds Italian nationality by descent.', NULL),
(168, 14, 'Jogador', 'Renan Fernandes Garcia', 'Renan Fernandes Garcia é um futebolista brasileiro. Atualmente, joga pelo Vitória de Guimarães.', NULL),
(169, 14, 'Jogador', 'Hugo Miguel Fernandes Vieira', 'Hugo Miguel Fernandes Vieira é um futebolista português que joga habitualmente a defesa. No final da época 2008/2009 deixou o Vitória de Setúbal e ingressou no Sport Clube Beira-Mar.', NULL),
(170, 14, 'Jogador', 'João Luiz Ramires Vieira', 'João Luiz Ramires Vieira, known as João Luiz (born December 20, 1985 in Brazil), is a footballer who currently plays as a midfielder for Beira Mar. He made his debut for Marítimo on December 23, 2007 in a 2–1 away victory against União Leiria. His first and so far only goal for the club came in a 4–1 defeat of Sporting Braga at home on April 19, 2008.', NULL),
(171, 14, 'Jogador', 'Hugo Filipe Pereira Seixas', 'Hugo Filipe Pereira Seixas (born 19 April 1991 in Mealhada) is a Portuguese footballer who plays for S.C. Beira-Mar as a striker.', NULL),
(172, 14, 'Jogador', 'Jaime Daniel Melão Simões', 'Jaime Daniel Melão Simões (born 11 June 1989 in Santarém), simply Jaime, is a Portuguese footballer who plays for S.C. Beira-Mar, as either a central defender or a defensive midfielder.', NULL),
(173, 14, 'Jogador', 'Wang Gang', 'Wang Gang is a Chinese football player who currently plays for S.C. Beira-Mar in Portugal.', NULL),
(174, 14, 'Jogador', 'Fernando Rui Valadares Pinto Sampaio', 'Fernando Rui Valadares Pinto Sampaio (born 29 May 1987 in Vila Pouca de Aguiar) is a Portuguese footballer who plays for S.C. Beira-Mar as a defensive midfielder.', NULL),
(175, 14, 'Jogador', 'Alexsandro Carvalho Lopes', 'Alexsandro Carvalho Lopes, mais conhecido como Alex Maranhão, é um futebolista brasileiro que atua como meio-campista.', NULL),
(176, 14, 'Jogador', 'Cristiano Moraes de Oliveira', 'Cristiano Moraes de Oliveira é um futebolista brasileiro, que atualmente joga no Sporting.', NULL),
(177, 14, 'Jogador', 'Yohan Tavarès', 'Yohan Tavares is a Portuguese footballer who plays for S.C. Beira-Mar, as a central defender.', NULL),
(178, 14, 'Jogador', 'Vasco Herculano S. C. M. Fernandes', 'Vasco Herculano Salgado Cunha Mango Fernandes, mais conhecido como Vasco Fernandes, é um futebolista português que actualmente está ao serviço do Celta de Vigo. Iniciou a carreira como profissional no campeonato português, tendo passado também pelo francês e espanhol. No início da época 2008/2009 regressou ao futebol português, trocando o Salamanca pelo Leixões Sport Club, que despertou novamente as equipas espanholas, tendo assinado pelo Celta de Vigo por empréstimo. Representou a selecção nacional nas suas várias camadas por diversas vezes (num total de 22 partidas), tendo sido convocado na primeira convocatória do escalão sub-23, em Outubro de 2009. Predefinição:Ref-section', NULL),
(179, 14, 'Jogador', 'André Filipe Farias Marques', 'André Filipe Farias Marques é um futebolista português. É defesa lateral esquerdo ascendeu ao plantel do Sporting Clube de Portugal de futebol profissional na época de 2005/2006, depois de começar a carreira nas camadas jovens do Sporting. No início da presente época 2007/08 foi cedido a título de empréstimo ao União de Leiria. Na época 2008/2009 esteve emprestado ao Vitória Futebol Clube, da Liga Sagres. No final da época regressou ao plantel da equipa da equipa Sporting Clube de Portugal. Em 2010, está atuando no S.C. Beira-Mar', NULL),
(180, 14, 'Jogador', 'João Duarte Vieira Pereira', 'João Duarte Vieira Pereira (born 10 May 1990 in Santarém) is a Portuguese footballer who plays for Beira-Mar, as a central defender. A product of Sport Lisboa e Benfica\\''s youth system, Pereira made his professional debuts in 2009–10, loaned to C.D. Fátima, in the second division. In 23, June 2011 he signed with SC Beira Mar.', NULL),
(181, 14, 'Jogador', 'Sérgio Manuel Costa Carneiro', 'Sérgio Manuel Costa Carneiro (born 21 February 1991 in Trofa), aka Serginho, is a Portuguese footballer who plays for S.C. Beira-Mar as a forward.', NULL),
(182, 14, 'Treinador', 'Rui Fernando Silva Calapez P. Bento', 'Rui Fernando da Silva Calapez Pereira Bento is a retired Portuguese footballer and a current coach. During his playing days he played mostly as a central defender.', NULL),
(183, 15, 'Jogador', 'Eduardo Fernandes Pereira Gomes', 'Eduardo Fernando Pereira Gomes, aka Dady (born 13 August 1981 in Lisbon), is a Cape Verdean-Portuguese footballer who plays for S.C. Olhanense as a striker.', NULL),
(184, 15, 'Jogador', 'Edson André Sitoe', 'Edson André Sitoe, mais conhecido como Mexer, é um futebolista internacional moçambicano que atua como defesa. Formado nas escolas do Grupo Desportivo de Maputo, actualmente joga pelo Sporting Clube de Portugal.', NULL),
(185, 15, 'Jogador', 'Rui Pedro Viegas Silva G. Duarte', 'Rui Pedro Viegas Silva Gomes Duarte (born 16 September 1978 in Lisbon) is a Portuguese footballer who plays for S.C. Olhanense in the Portuguese first division, as a central midfielder.', NULL),
(186, 15, 'Jogador', 'Carlos Eduardo Castro da Silva', 'Carlos Eduardo Castro da Silva, mais conhecido como Cadu, é um futebolista brasileiro, que joga actualmente no Hatta Club, do campeonato de futebol dos Emirados Árabes Unidos.', NULL),
(187, 15, 'Jogador', 'Nuno Miguel Torres Piloto Albuquerque', 'Nuno Torres Piloto Albuquerque, mais conhecido apenas como Nuno Piloto é um futebolista português que joga habitualmente como médio. É um dos jogadores da Académica de Coimbra licenciados pela Universidade de Coimbra. Terminou a licenciatura de Bioquímica em 2005, e o mestrado em 2009. Em Junho de 2009, depois de terminada a época 2008/09, Nuno assinou pelo Iraklis, do campeonato grego.', NULL),
(188, 15, 'Jogador', 'Luís Filipe Ângelo Rodrigues Fernandes', 'Luis Filipe Ângelo Rodrigues Fernandes, conhecido no mundo do futebol por Luís Filipe é um futebolista português que joga habitualmente a defesa direito.', NULL),
(189, 15, 'Jogador', 'Ivanildo Soares Cassamá', 'Ivanildo Soares Cassamá é um futebolista da Guiné-Bissau, que joga habitualmente a avançado. Ivanildo chegou ao FC Porto em 1997, aos nove anos, após ter sido descoberto por um treinador das camadas jovens portista, que viajou até África com o objectivo de descobrir novos talentos. Percorreu as camadas jovens do clube, jogou na equipa B e foi chamado pela primeira vez ao plantel principal por Víctor Fernández. Na época 2005/2006 foi campeão nacional e ganhou a Taça de Portugal pela mão de Co Adriaanse. No entanto jogou poucas vezes e para jogar com mais assiduidade foi emprestado à União Desportiva de Leiria, na época 2006/2007, e à Académica, na época 2007/2008. No início da época 2009/2010 rescindiu o contrato que o ligava com o Futebol Clube do Porto e assinou pelo Portimonense Sporting Clube.', NULL),
(190, 15, 'Jogador', 'Vítor Manuel Andrade Gomes Costa', 'Vítor Manuel Andrade Gomes da Costa (born 15 June 1977 in Lisbon), aka Toy, is a Cape Verdean-Portuguese footballer who plays for S.C. Olhanense as a forward.', NULL),
(191, 15, 'Jogador', 'William Kwabena Tiero', 'William Tiero é um futebolista do Gana.', 'true'),
(192, 15, 'Jogador', 'Marcel Malie Gomis', 'Marcel Malie Gomis é um futebolista senegalês que joga actualmente no Vizela.', NULL),
(193, 15, 'Jogador', 'Paulo Sérgio Moreira Gonçalves', 'Paulo Sérgio Moreira Gonçalves (born 24 January 1984 in Lisbon) is a Portuguese footballer who plays for S.C. Olhanense in the Portuguese first division, as a right winger.', NULL),
(194, 15, 'Jogador', 'Ricardo Jorge Cecília Batista', 'Ricardo Jorge Cecília Batista é um guarda-redes português. Actualmente representa a Selecção Nacional Portuguesa em Sub-21 e actuou, por empréstimo do Fulham, no Plymouth, clube do Championship. Em Portugal representou o Vitória de Setúbal. É um desportista forte e elegante, que defende muito confiante e seguro, e é apontado como um provável futuro substituto de Ricardo na Selecção A portuguesa para um futuro próximo. Em Julho de 2008 assinou pelo Sporting Clube de Portugal, um contrato válido durante 3 temporadas, por 150 mil euros. Representou a selecção nacional nas suas várias camadas por diversas vezes (num total de 20 partidas), tendo sido convocado na primeira convocatória do escalão sub-23, em Outubro de 2009.', NULL),
(195, 15, 'Jogador', 'Djalmir Vieira de Andrade', 'Djalmir Vieira de Andrade, simply Djalmir, is a Brazilian footballer who plays for S.C. Olhanense in the Portuguese first division, as a striker.', NULL),
(196, 15, 'Jogador', 'José Egas dos Santos Branco', 'José Egas dos Santos Branco, mais conhecido por Zequinha, é um futebolista português que joga a médio ala direito, ou extremo direito. Mora no bairro da Azeda com a familia apesar de ter casa própria. Formou-se nas escolas do Predefinição:PtST até despertar a atenção do Predefinição:PtPT em 2004. Esteve várias épocas ao serviço do Predefinição:PtPT tendo sido emprestado a vários clubes do primeiro e segundo escalão do futebol português. No início da época 2009/2010 assinou pelo Predefinição:PtOL, um contrato válido por três épocas.', NULL),
(197, 15, 'Jogador', 'Jorge Miguel Dias Gonçalves', 'Jorge Miguel Dias Gonçalves é um futebolista português, que joga habitualmente a avançado. No início da época 2008/2009 assinou pelo Racing de Santander, do Campeonato Espanhol de Futebol. Não se conseguiu impor no plantel principal da equipa espanhola, e foi cedido a título de empréstimo ao Vitória de Guimarães no início da época 2009/10.', NULL),
(198, 15, 'Jogador', 'Vítor Simões da Vinha', 'Vítor Simões da Vinha, mais conhecido por Vítor Vinha é um futebolista português que joga habitualmente como defesa esquerdo. Pertence à Associação Académica de Coimbra, da primeira liga (bwinLiga) portuguesa. Na época 2008/2009 esteve emprestado ao Estrela da Amadora. No início da época 2009/2010 foi anunciada a sua contratação pelo Nea Salamis, do campeonato cipriota.', NULL),
(199, 15, 'Jogador', 'Jean Paul Yontcha', 'Jean Paul Yontcha (nascido a 15 de Maio de 1983) é um futebolista dos Camarões, actualmente ao serviço do Sporting Clube Olhanense.', NULL),
(200, 15, 'Jogador', 'Fernando José Ribeiro Alexandre', 'Fernando José Ribeiro Alexandre is a Portuguese footballer who plays for S.C. Olhanense on loan from S.C. Braga in the Portuguese first division, mainly as a defensive midfielder.', NULL),
(201, 15, 'Jogador', 'Maurício Fernandes', 'Maurício Fernandes é um futebolista brasileiro, que joga habitualmente como zagueiro ou médio defensivo. No final da época 2007/2008 transferiu-se do Clube de Futebol Estrela da Amadora para o Enosis Ergotelis, do Campeonato Grego de Futebol.', NULL),
(202, 15, 'Jogador', 'Wilson Bruno Naval Costa Eduardo', 'Wilson Bruno Naval da Costa Eduardo is a Portuguese footballer who plays for S.C. Olhanense on loan from Sporting Clube de Portugal, as a forward.', NULL);
