(2, 2, '2012-05-10 08:35:00', 'Girabola: ASA vence 1º de Agosto e isola-se no segundo lugar', 'O Atlético  Sport  Aviação (ASA) venceu ontem o 1º de Agosto por 1-0, em jogo da 11ª jornada do campeonato nacional de futebol de Angola,  e  isolou-se no segundo lugar da tabela classificativa.\nO único golo da partida foi apontado por Manuel, quando', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.01 Transitional//EN" "http://www.w3.org/TR/html4/loose.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml" xmlns:og="http://ogp.me/ns#" xmlns:fb="http://www.facebook.com/2008/fbml">\r\n<head>\r\n	<META HTTP-EQUIV="Content-Type" CONTENT="text/html; CHARSET=iso-8859-1">\r\n	<META NAME="Keywords" CONTENT="futebol, liga sagres, super liga, benfica, fc porto, sporting, braga, campeonato, resultados, desporto, cristiano ronaldo, jos', 'http://www.futebol365.pt/noticias/artigo.asp?id=60607&CAT=Internacional', 'Sport Lisboa e Benfica'),
(3, 2, '2012-05-10 08:31:00', 'Benfica não aprende', 'O  Benfica  jogou muito  e  jogou pouco  e  as arbitragens provocaram-lhe dano (na segunda metade da Liga). O Sporting teve altos  e  baixos  e  as arbitragens provocaram-lhe dano (principalmente no arranque da Liga). O FC Porto nunca jogou muito bem', '\r\n\r\n\r\n\r\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml">\r\n<head>\r\n    <meta name="msapplication-tooltip" content="Start the page in Site Mode" />\r\n    <meta name="msapplication-starturl" content="http://www.record.xl.pt/" />\r\n    <meta name="msapplication-window" content="width=800;height=600" />\r\n    <meta name="msapplication-task" content="name=Home;action-uri=http://www.record.xl.pt/;icon-uri=http://www.record.xl.pt/favicon.ico" />\r\n    <meta name="msapplication-task" content="name=Benfica;action-uri=http://www.record.xl.pt/Futebol/Nacional/1a_liga/Benfica/default.aspx;icon-uri=http://www.record.xl.pt/favicon.ico" />\r\n    <meta name="msapplication-task" content="name=Porto;action-uri=http://www.record.xl.pt/futebol/nacional/1a_liga/porto/default.aspx;icon-uri=http://www.record.xl.pt/favicon.ico" />\r\n    <meta name="msapplication-task" content="name=Sporting;action-uri=http://www.record.xl.pt/futebol/nacional/1a_liga/sporting/default.aspx;icon-uri=http://www.record.xl.pt/favicon.ico" />\r\n    <meta name="msapplication-task" content="name=Real Madrid;action-uri=http://www.record.xl.pt/Futebol/Internacional/real_madrid/default.aspx;icon-uri=http://www.record.xl.pt/favicon.ico" />\r\n    <meta name="msapplication-task" content="name=Modalidades;action-uri=http://www.record.xl.pt/modalidades/default.aspx;icon-uri=http://www.record.xl.pt/favicon.ico" />\r\n    <meta name="msapplication-task" content="name=Multim', 'http://www.record.xl.pt/opiniao/cronistas/pressao_alta/interior.aspx?content_id=756016', 'Sport Lisboa e Benfic