a>\n </li>\n</ul>\n<span class="fixFloat"></span>\n</div>\n	</span>\n	</div>\n\n\n		<div id="content">\n<div class="col-left">\n			\r\n<div class="wid_content-box">\r\n\r\n    <div class="wid_here">\r\n        <p class="article-options">\r\n            <span class="facebook">\r\n            	<fb:like send="false" layout="button_count" width="150" show_faces="false" action="recommend" href="http://desporto.sapo.pt/futebol/primeira_liga/artigo/2012/05/10/acad_mica_em_vantagem_sobre_o_fe.html"></fb:like>\r\n\r\n            </span>\r\n            <span class="textoIncresa"><img src="http://imgs.sapo.pt/desporto/v2/images/novo_artigo/icon_print.png"  alt="Imprimir" onclick="window.print(); return false" /></span>\r\n            <span class="textoIncresa"><img src="http://imgs.sapo.pt/desporto/v2/images/novo_artigo/icon_small.png" width="16" height="16" alt="A-" onclick="return lowerText();" /></span>\r\n            <span class="textoIncresa"><img src="http://imgs.sapo.pt/desporto/v2/images/novo_artigo/icon_big.png" width="16" height="16" alt="A+" onclick="return biggerText();" /></span>\r\n            <span id="button">\r\n            </span>\r\n            <!--span class="textoIncresa"><img src="http://imgs.sapo.pt/desporto/v2/images/novo_artigo/icon_pdf.png" alt="" width="16" height="16" /></span-->\r\n        </p>\r\n        <p>\r\n            <strong class="tag">30.ª Jornada</strong>\r\n            <span class="data"><div class="date">10 de Maio de 2012 08:35h</div></span>\r\n        </p>\r\n    </div>              \r\n\r\n    <div class="wid_content">\r\n        <h1 class="wid_content-title">Académica em vantagem sobre o Feirense na luta da manutenção</h1>\r\n    </div>\r\n\r\n    <div class="id_tabsBox">\r\n        <div class="spc jtabs-history">\r\n            <ul class="wid_tabsBox-nav2" id="tabs-content">\r\n                <li><a href="#content-article" name="#content-article" title="Artigo" class="active-tab"><span><em class="ico-article">Artigo</em></span></a></li>               \r\n                \r\n                \r\n                \r\n            </ul>\r\n\r\n            <div id="content-article" class="panel active-tab-body" >\r\n                <div id="boxArtigo" class="snBox">\r\n                    <p class="author">Por SAPO Desporto c/Lusa</p>\r\n                    <h2 class="article-intro">Para o Feirense, se a despromoção se verificar, será o regresso uma época depois à Liga de Honra. \n</h2>\r\n                    <div class="article-txt">\r\n                        <div class="article-photo">\r\n                            \n<img src="http://thumbs.sapo.pt/?Q=90&pic=http%3A%2F%2Fimgs.sapo.pt%2Fimages%2FDESPORTO%2Fhp2%2Ffutebol%2Ftaca_de_portugal%2Facademica_coimbra_desportivo_aves_taca_portugal.jpg&W=254&H=190&hash=69aeebc1d9ccf24849f661874a60daa0" alt="Académica em vantagem sobre o Feirense na luta da manutenção"/>\n\r\n                        </div>\r\n                        \n\r\n\r\n                        <p>Académica e Feirense tentam, no sábado, na última jornada da Liga de futebol, a fuga à descida de divisão, faltando saber quem se junta à União de Leiria, num cenário em que os “estudantes” partem em vantagem.<br /></p> \n  <p>Com a Académica em 14.º lugar (26 pontos) e o Feirense em 15.º (24), basta à equipa de Coimbra um empate em Guimarães, já que os de Santa Maria da Feira têm desvantagem no confronto direto em caso de igualdade pontual. A Académica venceu em Coimbra por 4-0 na primeira volta, tendo empatado 1-1 na segunda.<br /></p> \n  <p>A tarefa será difícil para os dois conjuntos: a equipa de Coimbra – que esteve 16 jornadas sem vencer e apenas voltou a ganhar na última - visita o Vitória de Guimarães, sexto classificado, enquanto o Feirense. que está com a segunda pior série sem vencer (13 jogos) na Liga, vai a Barcelos com a obrigatoriedade de vencer o Gil Vicente e esperar sempre uma derrota da Académica.<br /></p> \n  <p>Para o Feirense, se a despromoção se verificar, será o regresso uma época depois à Liga de Honra, enquanto, se for a Académica, isso aconteceria 10 anos depois da sua última presença no escalão secundário, em 2001/02.<br /></p> \n  <p>Uma situação em suspenso é a possibilidade, aprovada pela Liga e que aguarda ratificação da Federação, de vir a disputar-se uma liguilha com os terceiro e quarto da Honra, numa hipótese de alargamento do campeonato a 18 clubes.<br /></p> \n  <p>No restante, a última jornada da Liga tem quase tudo de importante definido, com exceção a alguns lugares no meio da tabela, e com as posições entre os primeiro e oitavo lugares completamente encontradas.<br /></p> \n  <p>O campeão FC Porto fecha a época com uma visita ao Rio Ave e o vice-campeão Benfica viaja até ao Bonfim, onde defrontará o Vitória de Setúbal.<br /></p> \n  <p>Com o terceiro lugar seguro, de acesso à pré-eliminatória da Liga dos Campeões - ou mesmo &quot;play-off&quot;, caso o Chelsea se sagre campeão europeu -, o Sporting de Braga visita o Sporting, também com a quarta posição definida, num jogo para cumprir calendário.<br /></p> \n  <p>O Marítimo, no quinto lugar e com acesso à Liga Europa, receberá nos Barreiros o Paços de Ferreira, enquanto o Vitória Guimarães também poderá ir à segunda prova da UEFA, como sexto, mas apenas se o Sporting vencer a Académica na final da Taça de Portugal.<br /><br /><strong>sábado, 12 mai:</strong><br />Gil Vicente – Feirense, 18:30 (Sport TV4).<br />União Leiria – Nacional, 18:30.<br />Vitória Setúbal – Benfica, 18:30 (Sport TV2).<br />Vitória Guimarães – Académica, 18:30 (Sport TV3).<br />Rio Ave - FC Porto, 18:30 (Sport TV1).<br />Marítimo – Paços de Ferreira, 18:30.<br />Beira-Mar – Olhanense, 18:30.<br />Sporting – Sporting de Braga, 21:15 (TVI). </p>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n\r\n\r\n\r\n\r\n\r\n            <span class="fixFloat"></span>\r\n        </div>\r\n    </div>\r\n    <!-- /tabs -->\r\n    <!-- PUB -->\r\n    <div style="margin:5px"