'tab'']);\n                }\n                showVideo(videotoshow);\n            }\n        }\n        if(hash_params[''tab''] && activeTab != ''#''+hash_params[''tab'']) {\n            jesusTabs2History(".jtabs-history",''#''+hash_params[''tab'']);\n        } else if(!hash_params[''tab''] && jQuery(''.jtabs-history'')) {\n            jesusTabs2History(".jtabs-history",''#'');\n        }\n        if(hash_params[''tab''] == ''comentarios-jogo'') {	\n            clickOnComments();\n        }\n        if(hash_params[''tab''] == ''content-image'') {	loadPhotos(); }\n        if(hash_params[''tab''] == ''content-video'') {	loadVideos(); }\n        if(hash_params[''tab''] == ''estatisticas-jogo'') {	if (typeof(reloadStats === ''function'')) {reloadStats();} }\n        if(hash_params[''tab''] == ''content-report'') {	if (typeof(reloadReport === ''function'')) {reloadReport();} }\n        if(firstvisit) { firstvisit--; }\n    });\n    if(!document.location.hash && firstvisit) {\n        firstvisit--;\n    };\n});\n\nfunction hashMastigator(hash) {\n    hash = hash.replace(/^\\?/,'''');\n    hash_params = [];\n    var arr_url = hash.split(''&'');\n    for(var i=0;i<arr_url.length;i++) {\n        if(arr_url[i]) {\n            var rest = arr_url[i].split("=");\n            if(rest[1]) {\n                hash_params[rest[0]] = rest[1];\n            }\n        }\n    }\n};\n\nfunction jesusTabs2History(father,hash) {\n    if(hash == "#")\n        hash = jQuery(father + '' ul li:first a:first'').attr("name"); /*''#ao-minuto'';*/\n    if( hash && jQuery(father + '' ul li a[name="''+hash+''"]'').html() ) {\n    \n        jQuery(father + " ul li").removeClass("active");\n        jQuery(father + " ul li a").removeClass("active-tab");\n        jQuery(father + " div.panel").removeClass(''active-tab-body'');\n        jQuery(father + " .panel").hide();\n    \n        jQuery(father + '' ul li'').removeClass("active");\n        jQuery(father + '' ul li a'').removeClass("active-tab");\n   