(5, 2, '2012-05-09 23:35:00', 'Futebol com Todos: sobre o Luís Freitas Lobo', ' Facebook, minutos\ndepois da Liga Europa conquistada pelo Atlético Madrid, uma frase alegadamente escrita ou dita pelo Luís Freitas Lobo em 2009.\nQualquer coisa como \\"Falcao  é  um jogador lento que não vai resolver os problemas do  Benfica \\". Cred', '<!DOCTYPE html\n  PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd">\n<html xmlns:og="http://ogp.me/ns#" xmlns:fb="http://ogp.me/ns/fb#"\n      xmlns="http://www.w3.org/1999/xhtml">\n   <head>\n      <meta http-equiv="Content-Type" content="text/html; charset=UTF-8" />\n      <meta property="og:title" content="Futebol com Todos: sobre o Luís Freitas Lobo" />\n      <meta property="og:description" content="O que é perceber muito de futebol?" />\n      <meta property="og:image"\n            content="http://www.maisfutebol.iol.pt/multimedia/oratvi/multimedia/imagem/id/13332333" />\n      <meta property="og:url"\n            content="http://www.maisfutebol.iol.pt/opiniao---falar-de-bola/comentadores-luis-freitas-lobo-futebol-tv-radio-jornais/1347197-1448.html" />\n      <meta property="og:site_name" content="Maisfutebol" />\n      <meta property="og:type" content="article" />\n      <meta property="fb:app_id" content="197600320304159" />\n      <meta property="article:section" content="maisfutebol" />\n      <meta http-equiv="X-UA-Compatible" content="IE=EmulateIE7" />\n      <meta name="verify-v1" content="2D0b0m/FOBKQuHKeraw3SEm7+ORWD+yo3/OuGDKLJu8=" />\n      <title>COMENTADORES e LUÍS_FREITAS_LOBO -  Futebol com Todos: sobre o Luís Freitas Lobo\n         - Maisfutebol.iol.pt\n         \n      </title>\n      <META name="keywords"\n            content="COMENTADORES, LUÍS_FREITAS_LOBO, FUTEBOL, TV, RÁDIO, JORNAIS, Últimas notícias, jogos online futebol, Benfica, FC Porto, Sporting, Cristiano Ronaldo Facebook, Jose Mourinho, Champions League, Europa League, vídeos futebol, football players twitter e soccer        &#xA;            "></META>\n      <META name="description"\n            content="Futebol com Todos: sobre o Luís Freitas Lobo - O que é perceber muito de futebol?"></META>\n      <link rel="alternate" title="Maisfutebol RSS"\n            href="http://feeds.feedburner.com/iol/maisfutebol"\n            type="application/rss+xml" />\n      <link media="all" type="text/css" rel="stylesheet" href="/css/all_5.css?410" />\n      <link media="all" type="text/css" rel="stylesheet" href="/css/planeo.css?v11" />\n      <link media="all" type="text/css" rel="stylesheet" href="/css/gridsystem.css?v2" />\n      <link media="all" type="text/css" rel="stylesheet" id="csstakeover"\n            href="/css/takeover.css?v1" /><script type="text/javascript" src="/js/swfobject.js"></script><script type="text/javascript" src="/js/video.js?v3.2"></script><script type="text/javascript" src="/js/ie-hover-pack.js"></script><script type="text/javascript" src="/js/jquery.js"></script><script type="text/javascript" src="/js/jquery.ultralightbox.js?v3"></script><script type="text/javascript" src="/js/jquery.publicidade.js"></script><script type="text/javascript" src="/js/jquery.ultimas.js?v5"></script><script type="text/javascript" src="/js/jquery.jcarousel.min.js"></script><script type="text/javascript" src="/js/main.js?v14"></script><script type="text/javascript" src="/js/jquery.Maisfutebolsondagem.js"></script><script type="text/javascript" src="/js/jquery.reload.js?v2"></script><script type="text/javascript" src="/js/jquery.jcarousellite.js"></script><script type="text/javascript">\n            \n            $(document).ready(function(){\n            $("div.icons_rs li a").hover(\n            function(){$(this).siblings("div:first").show(),\n            $(''#aberto'').hide();},\n            \n            function(){$(this).siblings("div:first").hide(),\n            $(''#aberto'').show();}\n            );\n            $(".aberto").hover(\n            function(){$(this).siblings("div:first").show();},\n            function(){$(this).siblings("div:first").show();}\n            );\n            \n            });\n                \n        </script><script type="text/javascript"></script><script type="text/javascript" src="/js/realmedia/opiniao.js"></script><script type="text/javascript" src="/js/jquery.comentarios.js"></script><script type="text/javascript">\n                    $(document).ready(function() {\n                        $(''.email'').ultraLightBox({width:800,height:430});\n                        $(''.imprimir'').click(function(){ print(); return;});\n                    });\n                </script><script type="text/javascript" src="https://apis.google.com/js/plusone.js">\n                    { "parsetags": "explicit" }\n                </script><script type="text/javascript">\n                    {\n                        gapi.plusone.render("plusone-div",{"size": "tall", "count": "true"});\n                    }\n                </script></head>\n   <body class="inner-page">\n      <div id="fb-root"></div><script>\n                    (function(d, s, id) {\n                        var js, fjs = d.getElementsByTagName(s)[0];\n                        if (d.getElementById(id)) return;\n                        js = d.createElement(s); js.id = id;\n                        js.src = "//connect.facebook.net/en_GB/all.js#xfbml=1&amp;appId=197600320304159";\n                        fjs.parentNode.insertBefore(js, fjs);\n                    } (document, ''script'', ''facebook-jssdk''));\n                </script><div id="main"><a href="#main-nav" class="accessibility">skip to main navigation</a><div class="container">\n            <div id="bannerover"><script type="text/javascript">OAS_AD(''Bottom3'');</script><span>PUB</span></div>\n            <div class="holder">\n               <div class="top-news"><strong class="category"><span class="ultima-hora">GALERIA DE FOTOS:\n                        </span></strong><ul>\n                     <li><a href="http://www.maisfutebol.iol.pt/fotos/240160/1"><span class="imagem"><img src="http://www.maisfutebol.iol.pt/multimedia/oratvi/multimedia/imagem/id/13625023/70"\n                                   alt="Toda a festa do Atlético Madrid"\n                                   border="0" /></span>Toda a festa do Atlético Madrid</a></li>\n                  </ul>\n               </div>\n               <div class="main-area">\n                  <div class="heading-box"><span class="divisao"><a href="/opiniao" title="">Falar de Bola</a></span><span class="seccaoTop"></span></div>\n                  <div class="article-heading">\n                     <div>\n                        <div class="paginator"><span>1 de\n                              15 notícias</span><a class="link-next"\n                              href="/opiniao---falar-de-bola/cartao-de-memoria-sporting-az-alkmaar-miguel-garcia/1347089-1448.html">\n                              						»\n                              	</a></div>\n                        <h1>Futebol com Todos: sobre o Luís Freitas Lobo</h1>\n                        <h2>O que é perceber muito de futebol?</h2><em class="name"><img src="/images/autores/alexandrepereira.jpg" width="40" align="absmiddle"\n                                alt="Alexandre Pereira*" /><i>Por </i><a href="mailto:napereira@tvi.pt">Alexandre Pereira*</a></em><em class="date">2012-05-10 00:25h\n                           </em></div>\n                  </div>\n                  <div class="article-content"><iframe src="//www.facebook.com/plugins/like.php?href=http%3A%2F%2Fwww.maisfutebol.iol.pt/opiniao---falar-de-bola/comentadores-luis-freitas-lobo-futebol-tv-radio-jornais/1347197-1448.html&amp;send=false&amp;layout=standard&amp;width=450&amp;show_faces=true&amp;action=like&amp;colorscheme=light&amp;font=arial&amp;height=80&amp;appId=197600320304159"\n                             scrolling="no"\n                             frameborder="0"\n                             style="border:none; overflow:hidden; width:450px; height:58px;"\n                             allowTransparency="true"></iframe><div class="pub-line"><span>PUB</span><script type="text/javascript">OAS_AD(''x20'');</script></div>\n                     <div class="text"><p>Não sei se isto acontece em todas as áreas profissionais ou de lazer, mas desconfio que sim. Entre gente que se dedica\n                        ao comentário de futebol acontece de certeza: miramo-nos todos uns aos outros pelo canto do olho à espera de um deslize alheio.\n                        Não é necessariamente por mal, às vezes é só mesmo para reconfortarmos os nossos próprios enganos na almofada fofa da constatação\n                        de que os outros - mesmo os mais conceituados e bem pagos - também se enganam. Inveja? Não diria tanto. Numa base filantrópica,\n                        arrisco que talvez seja só a busca da perfeição.<br/><br/>Vem isto a propósito de se ter multiplicado no Facebook, minutos\n                        depois da Liga Europa conquistada pelo Atlético Madrid, uma frase alegadamente escrita ou dita pelo Luís Freitas Lobo em 2009.\n                        Qualquer coisa como "Falcao é um jogador lento que não vai resolver os problemas do Benfica". Credo, isto não é olhar pelo\n                        canto do olho, é esgravatar arquivos!<br/><br/>Não sei se o Luís Freitas Lobo é o comentador de jornal, rádio e TV que mais\n                        percebe de futebol em Portugal. Aliás, em última análise tenho dificuldades em perceber o que é perceber muito de futebol.\n                        É ter os vencedores da Taça do Rei de Espanha todos decorados, numa gaveta da memória ao lado daquela de onde sacamos à primeira\n                        os onzes do Benfica e do Sporting da década de 70? Conhecer a história das táticas e contratáticas? Saber o nome de imensos\n                        jogadores do campeonato brasileiro e internacionais sub-21 do Japão?<br/><br/>Na verdade não sei bem. O que sei é que o Luís\n                        Freitas Lobo devora jogos e livros de futebol como poucas pessoas no mundo farão, vê mais jogos de futebol num fim de semana\n                        do que eu sou capaz de ver num mês e, acima de tudo, conquistou os seus (agora vários) espaços de opinião à custa desse suor\n                        e dessa paixão.<br/><br/>Sei mais: sei que é dos poucos comentadores de futebol que, sem ter sido atleta de eleição, é respeitado\n                        por um considerável número de treinadores no ativo. E isso, perdoem-me, quer dizer alguma coisa. Também deve querer dizer\n                        alguma coisa o facto de, após ter começado em A Bola, ter sido contratado pelo Expresso, pela TSF, pela RTP e depois pela\n                        Sport TV para ocupar espaços nobres de análise ao jogo. Não terá sido por acaso que por mais de uma vez esteve em conversações\n                        com clubes de futebol profissionais para integrar uma estrutura diretiva.<br/><br/>Não lê sempre o jogo da melhor maneira,\n                        com certeza. Não analisa na perfeição uma equipa da Letónia que na semana seguinte vai jogar com o Braga, acredito. Não adivinha,\n                        naturalmente, o futuro de cada jogador que vê atuar na TV ou no estádio. Agora apontem-me, por favor, um treinador que leia\n                        sempre o jogo da melhor forma, um observador que faça sempre o relatório perfeito do próximo adversário ou o diretor desportivo\n                        que acerte sempre nas contratações. Nem Mourinho, que é um pouco de tudo isto, faz de todos os seus jogadores um sucesso.<br/><br/>Basicamente,\n                        a coisa resume-se a gostar ou não de ler e ouvir o homem. Entre leitores, ouvintes e telespectadores há com certeza muito\n                        quem aprecie e muito quem diga mal. Aposto que há mais quem aprecie, porque os tempos não estão para jornais, rádios e televisões\n                        andarem a pagar colunistas só porque sim.<br/><br/>Não sou amigo pessoal do Luís. Conhecemo-nos, trabalhámos de forma algo\n                        próxima e tenho um profundo respeito pelo percurso dele, só isso. Chateia-me solenemente que se perca tempo a rebuscar palavras\n                        ditas há três anos para a partir daí se apregoar a alegada incompetência de alguém. Como se todos soubéssemos a que sabem\n                        os melões antes de os abrir e provar.<br/><br/><i>*Editor TVI<br/><a href=http://www.futebolcomtodos.pt <b>www.futebolcomtodos.pt</b></a><br/><a\n                        href=http://www.futebolcomtodos.com <b>www.futebolcomtodos.com</b></a></i></p>\n                     </div>\n                     <div class="boxFunctions"><a href="https://twitter.com/share" class="twitter-share-button"\n                           data-via="maisfutebol_iol"\n                           data-lang="pt">Tweet</a><script>!function(d,s,id){var js,fjs=d.getElementsByTagName(s)[0];if(!d.getElementById(id)){js=d.createElement(s);js.id=id;js.src="//platform.twitter.com/widgets.js";fjs.parentNode.insertBefore(js,fjs);}}(document,"script","twitter-wjs");</script><fb:like style="float:left"\n                                 href="http://www.maisfutebol.iol.pt/opiniao---falar-de-bola/comentadores-luis-freitas-lobo-futebol-tv-radio-jornais/1347197-1448.html"\n                                 send="true"\n                                 layout="button_count"\n                                 width="100"\n                                 show_faces="false"\n                                 font="arial"></fb:like><a id="comentarLink" href="#comentar">Comentar</a></div>\n                     \n                     As últimas 15 da secção             \n                     "<a href="/opiniao" title="">Falar de Bola</a>":\n                     \n                     <div class="paginatorB