(7, 2, '2012-05-09 18:42:00', 'Futebol: Belenenses -- Léo Kanú suspenso e sob alçada disciplinar', ' Lisboa , 09 mai (Lusa) - O Belenenses instaurou hoje um processo disciplinar ao futebolista Léo Kanú  e  suspendeu preventivamente o jogador por declarações proferidas numa rede social, antes do encontro com o Sporting da Covilhã.\nEm comunicado divu', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.01 Transitional//EN" "http://www.w3.org/TR/html4/loose.dtd">\n<html lang="pt-PT">\n	<head>\n	  <meta http-equiv="content-type" content="text/html; charset=iso-8859-1">\n  	<meta name="robots" content="index,follow">\n  	<meta content="document" name="resource-type">\n		<meta content="pt-PT" http-equiv="Content-Language">\n		\n		<meta name="description" content="">\n		<meta name="keywords" content="belenenses"> \n	  <title>Futebol  Belenenses    L', 'http://visao.sapo.pt/futebol-belenenses-leo-kanu-suspenso-e-sob-alcada-disciplinar=f663568', 'Sport Lisboa e Benfica'),
(8, 2, '2012-05-09 16:26:00', 'F.C.Mãe D´Água alcançou 3º lugar na \\"Danone Nations Cup\\"', '´Água apresenta-se no dia 20 deste mês no Estádio da Luz no torneio de encerramento da Geração  Benfica , segue-se a Taça Coca-Cola em iniciados no dia 27 em Viseu  e  no mesmo dia os infantis participam em  Lisboa  num Torneio do Sporting.\nEscrito p', '<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml">\r\n<head>\r\n<meta name="verify-v1" content="cop6VXRDuHwIx3wVfbRDlzJB2YuzecT1+UJ6sAa6sj0=" />\r\n\n\n\n<title>R', 'http://www.brigantia.pt/index.php?option=com_content&task=view&id=7020&Itemid=43', 'Sport Lisboa e Benfica'),
