oftInternetExplorer4</w:BrowserLevel>\r\n </w:WordDocument>\r\n</xml><![endif]--><!--[if gte mso 9]><xml>\r\n <w:LatentStyles DefLockedState="false" LatentStyleCount="156">\r\n </w:LatentStyles>\r\n</xml><![endif]--><!--[if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:"Tabela normal";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-parent:"";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin:0cm;\r\n	mso-para-margin-bottom:.0001pt;\r\n	mso-pagination:widow-orphan;\r\n	font-size:10.0pt;\r\n	font-family:"Times New Roman";\r\n	mso-ansi-language:#0400;\r\n	mso-fareast-language:#0400;\r\n	mso-bidi-language:#0400;}\r\n</style>\r\n<![endif]-->\r\n\r\n<p style="text-align:justify;background:white"><font color="#FF0000" size="6"><b style="mso-bidi-font-weight:\r\nnormal"><span style="font-size:10.0pt;font-family:Arial;color:#333333">Equipa de\r\nfutebol dos Infantis do Clube Desportivo de Mafra sobe à Divisão de Honra</span></b></font></p>\r\n\r\n<p style="text-align:justify;background:white"><span style="font-size:10.0pt;\r\nfont-family:Arial"><br></span></p>\r\n\r\n<p style="text-align:justify;background:white"><span style="font-size:10.0pt;\r\nfont-family:Arial">O Campeonato Distrital de Infantis 1ª Divisão – série 1, foi\r\nganho pelo União Atlético Povoense, tendo o Clube Desportivo de Mafra alcançado\r\no quarto lugar, logo depois do Sacavenense (2º) e do Torreense (3º). As\r\nrestantes equipas concelhias que militam nesta divisão, o Clube Desportivo da\r\nVenda do Pinheiro e o Atlético Clube da Malveira, asseguraram a permanência classificando-se\r\nrespectivamente em 11º e 12º lugares. </span></p>\r\n\r\n<p style="text-align:justify;background:white"><span style="font-size:10.0pt;\r\nfont-family:Arial">Na próxima época os Infantis do Clube Desportivo de Mafra\r\ndefrontarão 14 equipas, das quais sobressaem o Sporting, Benfica, Belenenses,\r\nPovoense, Sacavenense e Torreense.</span></p>\r\n\r\n<p style="text-align:justify;background:white"><span style="font-size:10.0pt;\r\nfont-family:Arial;color:#333333">Na segunda fila (em pé) a partir da esquerda:\r\nMiguel Silva (Massagista), Nelson Pinto (Treinador adjunto), Pedro Cancela,\r\nQuevin Batalha, Duarte Rocha, Pedro Branco, Bernardo Galantinho, Gonçalo\r\nPessoa, Mauro Santos, João Honrado, Bernardo Sousa, Joaquim Caetano (Treinador\r\nprincipal), José Honrado (Delegado), Tiago Realista (representante do patrocinador\r\noficial Herbalife).</span></p>\r\n\r\n<p style="text-align:justify;background:white"><span style="font-size:10.0pt;\r\nfont-family:Arial;color:#333333">Na primeira fila a partir da esquerda: André\r\nSimões, Luís Sousa, João Romão, Diogo Rodrigues, Pedro Gonçalves, Pedro\r\nLourenço, Sérgio Sobreira, Ivo Pina, Daniel Lopes, Diogo Mano e Pedro Realista\r\n(filho do representante do patrocinador oficial Herbalife, que também se juntou\r\nà festa da promoção).</span></p>\r\n\r\n<p style="text-align:justify;background:white"><span style="font-size:10.0pt;\r\nfont-family:Arial;color:#333333">A equipa é ainda constituída por: Alexandre\r\nCarvalho, António Ramos, Diogo Pimentel, Jorge Salgueiro, Wilson Ventura e Marco\r\nTeixeira (Treinador Adjunto).</span></p>\r\n\r\n<p style="text-align:justify;background:white"><span style="font-size:10.0pt;\r\nfont-family:Arial;color:#333333">&nbsp;</span></p>\r\n\r\n</span></P>\r\n												<P align="right">\r\n													<span id="NewsLast_ctl00_LblDate">\r\n														&nbsp;09/05/2012</span>\r\n												</P>\r\n												<P align="left">\r\n													<span id="NewsLast_ctl00_LblUser">\r\n														&nbsp;Por:oericeira</span>\r\n												</P>\r\n											</TD>\r\n										</TR>\r\n									</TABLE>\r\n								\r\n							<P align="center">&nbsp;</P>\r\n							<P><div id="Panel1">\r\n	\r\n      <P align=center><FONT size=3><STRONG>Comentarios</STRONG></FONT>:</P>\r\n      <P></P>\r\n      <P 