('benfica leiria, sport lisboa e benfica, bancada coca-cola diabos vermelhos 82', 'Benfica 1-0 Leiria 5/5/2012 O voo da Águia Vitória', 'Sport Lisboa e Benfica', 'https://www.youtube.com/v/NV2NmNVECMg?version=3&f=videos&app=youtube_gdata', 1),
('Na 29.ª e penúltima rodada, a União de Leiria, com vários juniores em campo e depois de semanas polémicas, salários em atraso e rescisões de jogadores, viu confirmada a sua queda de divisão, com uma derrota (1-0) na visita ao Benfica, cujos torcedores se despediram do treinador e outros responsáveis com lenços brancos, assobios e insultos, apesar de assegurado o segundo posto ea entrada na fase de grupos da Liga dos Campeões. Copa Europa 2012 Todos os Gols | Chelsea x FC Bayern Munchen | Liga dos Campeões 19/05/2012 2012 Destaques | Bahia x Portuguesa | 02/05/2012 Copa do Brasil 2012 todos os Objectivos e Destaques Copa Santander Libertadores Todos os Objetivos de & Highlights - Copa Libertadores 02-05-2012 02-05-2012 Liga dos Campeões da Europa 2012 Taça Libertadores Da América 2012 Todos os Gols e jogo completo Destaques 03/05/2012 Resumen Todos Los Goles Copa Libertadores 2012 Destaques do jogo inteiro todas as Metas = 2012/05/02 Tous Les Buts = melhores momentos Ampia Sintesi Tutti I Gol 02-05-2012 Und Alle Tore Destaques 02/05/2012 Alle Tore Destaques Und 02-5-12 Все Цели И Моменты Кубок Либертадорес Santander Все Цели И Показатели - Кубок Либертадорес 02-05-2012 Taca Либертадорес Да Америка 2012 Все Цели И Полный Матч Основные 22.04/2012 Resumen Goles Тодос Лос Кубок Либертадорес 2012 Полный Моменты Матча Все Цели = Tous Les 2012/04/26 Буц = 24/04/2012 Ampia Sintesi Тутти Я Гол Alle Торе Унд Основные Alle Торе Унд Основные 18-4-12 Alexis Sanchez Acessos Crossbar ...', 'Com gol de Hulk FC do Porto vence por 2x0 ao Sporting Lisboa que sonha com a Champions', 'Sport Lisboa e Benfica', 'https://www.youtube.com/v/-JU2P5_7ujo?version=3&f=videos&app=youtube_gdata', 2),
('FC PORTO X SPORTING - 1º PARTE www.dailymotion.com FC PORTO X SPORTING - 2º PARTE www.dailymotion.com BENFICA X U. LEIRIA - 1º PARTE www.dailymotion.com BENFICA X U. LEIRIA - 2º PARTE www.dailymotion.com', '29º JORNADA ( Liga ZON Sagres )', 'Sport Lisboa e Benfica', 'https://www.youtube.com/v/yTAy9lAS2KE?version=3&f=videos&app=youtube_gdata', 3),
('Acompanhe este sábado (5 de Maio), em Desporto na Hora, a partir das 20:30, os jogos: FC Porto x Sporting Benfica x União Leiria Siga-nos no Facebook ! www.facebook.com', 'FC Porto x Sporting e Benfica x União Leiria', 'Sport Lisboa e Benfica', 'https://www.youtube.com/v/astPMBPNriE?version=3&f=videos&app=youtube_gdata', 4),
('O campeonato de 1964/1965 ficará para sempre na memória do Sport Lisboa e Benfica. No decorrer de uma época excepcional, a equipa de futebol conquista o segundo tri-campeonato da sua história, vê Eusébio ganhar a \\"Bola de Ouro\\" ea Bola de Prata e marca presença, pela quarta vez, na final da Taça dos Campeões Europeus. A final europeia de San Siro seria um dos jogos mais dramáticos de sempre dos encarnados em competições europeias.', 'Vitórias e Património - Campeão 64-65', 'Sport Lisboa e Benfica', 'https://www.youtube.com/v/Ts4abXCJoEI?version=3&f=videos&app=youtube_gdata', 5),
('Golo controverso do Luisao que deu, praticamente, a decisao do titulo da época 2004-2005 para o Benfica. Foi o único video que fiz durante o jogo todo.. Chama-se feeling pelo golo!', 'Golo Luisão - Benfica 1 - 0 Sporting - Época 2004-2005', 'Sport Lisboa e Benfica', 'https://www.youtube.com/v/4rFXxV0ITdg?version=3&f=videos&app=youtube_gdata', 6),
('Entrar em campo com 8?! Isso é para meninos, pá! ------------------------------------------------------------------------------------------------------ Este sketch faz parte de um projecto de promos aos jogos do Sport Lisboa e Benfica na Benfica TV, feito por 4 Aristocratas: Amílcar Monteiro, Celso Moura, Cláudio Almeida e Rui Cruz.', 'Benfica Vs. U. Leiria (Sketch Aristocratas)', 'Sport Lisboa e Benfica', 'https://www.youtube.com/v/xU-xVcrxBRM?version=3&f=videos&app=youtube_gdata', 7),
('Belle ambiance au stade José Alvalade', 'Sporting - Benfica', 'Sport Lisboa e Benfica', 'https://www.youtube.com/v/svxsxotvKQ0?version=3&f=videos&app=youtube_gdata', 8),
('O rescaldo da jornada desportiva do fimde- semana é, à segunda-feira, na TVI24, com uma nova imagem onde sobressaem leões, águias e dragões. Um programa com reportagens, entrevistas e debates, apresentado por Joaquim Sousa Martins e com um painel exemplar - Eduardo Barroso, pelo Sporting, Fernando Seara, pelo Benfica, e Manuel Serrão, pelo FC Porto.', 'Prolongamento ( TVI24 ) 30 / 04 / 2012', 'Sport Lisboa e Benfica', '', 9),
('«A noite do Futrebol»: o programa de Paulo Futre que promete virar do avesso as noites da televisão portuguesa. Para já, pode confirmar isso mesmo nos vários vídeos que lhe apresentamos da estreia de Futre, que falou dos tempos de Sporting e Benfica .', 'A Noite do Futrebol ( TVI24 ) 01 / 05 / 2012', 'Sport Lisboa e Benfica', 'https://www.youtube.com/v/VkHBqKqT41A?version=3&f=videos&app=youtube_gdata', 10),
('', 'Juvenis A, Jornada 3 - SL Benfica 1-0 Sporting CP', 'Sport Lisboa e Benfica', 'https://www.youtube.com/v/Z5mFwFvTQ3o?version=3&f=videos&app=youtube_gdata', 11),
('Há bastante tempo que queria fazer este video sobre o benfica, espero que dêm a vossa opinião e subscrevam o canal. \\"Mais que um clube, um religião, Sport Lisboa e Benfica \\"', 'Sport Lisboa e Benfica - E Pluribus Unum (720p)', 'Sport Lisboa e Benfica', 'https://www.youtube.com/v/P2U9NnBVWNo?version=3&f=videos&app=youtube_gdata', 12),
('Um jogo verbal sem tempos mortos com Tiago Alves, Miguel Guedes, Jaime Mourão-Ferreira e Telmo Correia. Todas as semanas, Miguel Guedes (fcporto), Jaime Mourão-Ferreira(sporting) e Telmo Correia(benfica) vão vestir a camisola do seu clube e promover uma tertúlia com a elegância que nem sempre prevalece no futebol português. Grandes Adeptos às segundas-feiras, às 19h12 (com repetição na na madrugada de 2ª para 3ªfeira,após edição das 02h), com arbitragem do jornalista Tiago Alves.', 'Grandes Adeptos antena1 30-04-2012 especial FC Porto campeao', 'Sport Lisboa e Benfica', 'rtsp://v4.cache5.c.youtube.com/CiILENy73wIaGQmXnewH2fVmHxMYDSANFEgGUgZ2aWRlb3MM/0/0/0/video.3gp', 13),
('VIVA AO PORTO VIVA AO SPORTING VIVA AO BENFICA OLE OLE OLE', 'ROSA MARIA tres equipas', 'Sport Lisboa e Benfica', 'https://www.youtube.com/v/5IZe30RuOII?version=3&f=videos&app=youtube_gdata', 14),
('Pes 2012 - Sporting vs Benfica Comentários em português de portugal', 'Pes 2012 - Sporting vs Benfica [PT]', 'Sport Lisboa e Benfica', 'https://www.youtube.com/v/jP2PpJ7cHVE?version=3&f=videos&app=youtube_gdata', 15),
('A equipa do Benfica foi recebida esta madrugada no Estádio da Luz com assobios e insultos por algumas dezenas de adeptos. Após a vitória frente ao Gil Vicente, que ditou a conquista da quarta Taça da Liga, a comitiva encarnada foi recebida com algum desagrado no regresso a Lisboa. Passava pouco das 2h00 quando a equipa chegou à Luz. Houve assobios assim que a viatura apareceu junto ao estádio. E depois, novamente quando os jogadores saíram de carro. Apenas o médio argentino Pablo Aimar parou para saudar os adeptos, mas nem isso serenou os ânimos, ouviram-se mais insultos sobretudo à passagem do carro onde seguia o treinador Jorge Jesus. Nem todos os adeptos que aguardavam a equipa manifestaram este desagrado, alguns gritaram palavras de apoio, mas fica então o registo de insultos à equipa por parte de pelos menos duas dezenas de adeptos.', 'Equipa do Benfica recebida esta madrugada no Estádio da Luz com assobios e insultos', 'Sport Lisboa e Benfica', 'https://www.youtube.com/v/bPsmoBniePo?version=3&f=videos&app=youtube_gdata', 16),
('Sporting Clube de Portugal, also known as Sporting CP, Sporting or Sporting Lisbon, is a Portuguese multi-sports club based in Portugal\\''s capital city of Lisbon. Although they successfully compete in a number of different sports, Sporting is mostly known for its association football team. Founded in Lisbon in July 1, 1906, it is one of the \\"Três Grandes\\" football clubs in Portugal, with Sport Lisboa e Benfica and Futebol Clube do Porto being the other two clubs, Sporting\\''s two biggest rivals. With more than 100000 registered club members, its teams, athletes and supporters are often nicknamed Leões by its fans.', 'Sporting Clube de Portugal ♥', 'Sport Lisboa e Benfica', 'https://www.youtube.com/v/dgPWQQR07TM?version=3&f=videos&app=youtube_gdata', 17),
('03/08/1993 - Cruzeiro 1 X 1 Benfica (POR) Luz (Lisboa, Portugal) Gols : Luis Fernando (C) , Isaias (B) Este e um dos primeiros jogos de Ronaldo como profissional', '1993 - Cruzeiro x Benfica', 'Sport Lisboa e Benfica', 'https://www.youtube.com/v/5Oto59D4R9Q?version=3&f=videos&app=youtube_gdata', 18),
('El mejor partido que vi en La Catedral, habeis exo mas k otros clubes multimillonarios del de toda Europa, soys Enormes. Beti Athletic!!!', 'Athletic - Sport Lisboa Minutos Finales, Bufandeos!!!', 'Sport Lisboa e Benfica', 'https://www.youtube.com/v/4GLSc9ldMkc?version=3&f=videos&app=youtube_gdata', 19),
('The official Sport Lisboa e Benfica 2011-12 First Team soccer dynamic theme. See an assortment of players and their stats each time you return to your XMB™. Available in English and Portuguese. Sony Americas Region - coming soon Sony European Region - coming soon', 'SL Benfica 2011-2012 First Team PS3 Dynamic Theme', 'Sport Lisboa e Benfica', 'https://www.youtube.com/v/dOhA_Bfoqd0?version=3&f=videos&app=youtube_gdata', 20),
('', 'Duarte futuro craque do Sporting ou do Benfica?', 'Sport Lisboa e Benfica', 'https://www.youtube.com/v/4MgGliRc_fw?version=3&f=videos&app=youtube_gdata', 21),
